(19622, 1706, 2, 'Get the blazing speed of Gigabit Ethernet with the D-Link GigaExpress DGS-1005D, a 5-port 10/100/1000Mbps Gigabit Switch that delivers power, performance, and reliability in one cost-effective, space-saving design. Increase the speed of your network server and backbone connections, or make Gigabit to the desktop a reality. Power users in the home, office, workgroup, or creative production environment can now move large, bandwidth-intensive files faster. Transfer graphics, CGI, CAD, or multimedia files across the network instantly.The D-Link DGS-1005D 10/100/1000 Mbps Gigabit Switch features a non-blocking switching architecture that filters and forwards packets at full wire-speed for maximum throughput. An 8, 000 MAC address table provides scalability for even the largest networks. Address learning and aging, 802.3x Flow Control for full duplex mode, and back pressure flow control for half-duplex mode alleviates traffic congestion and ensures reliable data transmission. Designed using industry standards, it is compatible with virtually all 10, 100, and 1000Mbps Ethernet devices and other vendor equipment. The D-Link DGS-1005D 10/100/1000 Mbps Gigabit Switch protects your existing network investments while providing you with a straightforward migration path to faster Gigabit speeds.The auto features of this gigabit switch make installation plug and play and hassle-free. No configuring is required. Auto MDI/MDI-X crossover on all ports eliminate the need for crossover cables or uplink ports. Auto-negotiation on each port senses the link speed of a network device (either 10, 100, or 1000 Mbps) and intelligently adjusts for compatibility and optimal performance. It also features diagnostic LEDs which display status and activity, allowing you to quickly detect and correct problems on the network.'),
