(19876, 1719, 2, 'An ideal companion to the rapidly emerging class of 10-gigabit servers, the NETGEAR ProSafe 52-port gigabit stackable smart switch is the smart switch with 10-gigabit connectivity - delivering maximum throughput in SMB networks for demanding tasks such as data replication and backup, virtualization, video on demand and high-volume transaction processing. At less than half the cost of a managed switch, the ProSafe 52-port gigabit smart switch provides 48 gigabit ports for connecting devices to the network, along with four 10 GE SFP+ ports for stacking or uplink to servers. The GS752TXS offers a rich enterprise-class feature set, including advanced traffic management and security, yet can be easily configured and monitored through a web-based graphical user interface.With a rich set of Layer 2 management features, the GS752TXS is efficient, secure and ready for the future. Static routing allows for segmentation of the network, with internal routing through the switch - reserving the router for external traffic routing only, making the entire network more efficient. Dynamic VLAN assignment increases security by imposing consistent policy and user credentials across the network, regardless of where users connect. Support for MLD Snooping greatly increase network efficiency by forwarding multicast traffic to designated hosts only, rather than flooding multicast packets across all ports. The GS752TXS also comes with full IPv6 support, comprehensive security and advanced multicast management.'),
