(20681, 1768, 2, 'The TL-SG2424P provides 24 10/100/1000 Mbps ports that support 802.3at/af-compliant PoE, with a total PoE power supply up to 180 W, powerful and flexible enough for users to deploy wireless access points or IP-based network surveillance cameras. The switch also comes equipped with 4 combo SFP slots, expanding your network flexibly. In addition, it provides high performance, enterprise-level QoS, useful security strategies and rich layer 2 management features. With all these advanced features, the Gigabit Smart PoE switch is an ideal choice for small and medium business networking.TL-SG2424P has useful security features. The storm control feature protects against broadcast, multicast and unknown unicast storm. Quality of Service provides enhanced traffic management capabilities to move your data smoother and faster. Anymore, the easy-to-use web management interfaces, along with CLI, SNMP and RMON, mean faster setup and configuration with less downtime. For workgroup and departments requiring cost-sensitive layer 2 switch and gigabit capability, TP-LINK Gigabit Smart PoE switch TL-SG2424P provides you the ideal access-edge solution.'),
