(21343, 1805, 2, 'D-Link\'s DGS-105 and DGS-108 Gigabit Ethernet switches provide a cost-effective way for small and medium sized businesses to create a small network and connect computers, wireless Access Points, IP cameras, network printers and other Ethernet devices quickly and easily without complicated configurations. These switches come with 5 or 8 Gigabit Ethernet ports with an auto-sensing function to detect the maximum speed of the connected devices, allowing you to run your network with the best possible performance. Their fanless design and solid metal housing makes them completely silent so they are ideal for offices, libraries or meeting rooms, and for industrial and hazardous environments like factories and warehouses.The DGS-105 and DGS-108 are designed with durability and performance in mind. Their sturdy metal housing will protect them against accidental harm, while helping to dissipate heat and to reduce stress on internal components. The LEDs allow for an easy reading of each port status and speed, helping to troubleshoot connectivity problems. For a convenient placement, these switches come with a wall mounting kit and a slot for a Kensington security lock to protect them from theft.Despite being unmanaged, Plug and Play switches, the DGS-105 and DGS-108 are able to classify network traffic by assessing the 802.1p field in the Ethernet frames, and forward them out of its ports depending on their priority. This allows for a smooth integration of video, voice and data traffic without delays or loss of quality.The cable diagnostics function enables users to quickly troubleshoot faulty network cables that may lead to transmission errors. At startup, the switch performs a micro-test to assess the quality of the cables connected to its ports. If a fault is detected, the ambar LED will lit up. If the cables pass the test, the green LED will be illuminated, indicating that the network is error-free. This feature can save valuable time when trying to single out a faul'),
