(21504, 1824, 2, 'The DIR-850L Wireless AC1200 Dual-Band Gigabit Cloud Router lets you easily connect to, control and monitor your network using the future of wireless technology and unique mydlink. By downloading the free mydlink app you can monitor your home network remotely. Plus, with the included SharePort Technology, accessing and sharing your files, playlists and videos have never been so easy.This router creates the fastest home network possible today connecting all of your computers and mobile devices to your broadband Internet connection. Concurrent dual-band 802.11ac brings you the future of high-bandwidth wireless connectivity, allowing you to stream HD video, make Internet calls, and surf the Internet without interruption. Gigabit Ethernet ports provide high-speed wired connections for up to four PCs or other devices. It\'s stylish, easy-to-use, and is IPv6-ready for a reliable network today and tomorrow.The DIR-850L uses the latest Wireless AC technology, which can provide transfer rates of up to 867 Mbps. Faster gigabit wireless speeds allow you to download contents and sync files 3 times faster than the previous standard and provide you with whole home coverage. The router operates on both the 2.4 GHz band and 5 GHz wireless bands at the same time using concurrent dual-band technology and six internal antennas. This allows you to browse the web, chat and e-mail using the 2.4 GHz band, while simultaneously streaming digital media, playing online games, or making Internet phone calls on the 5 GHz band.This router gives you complete control by allowing you to monitor who is connecting to your network, which sites they are visiting and block unwanted visitors. You can monitor your home network remotely through the mydlink web portal or by downloading the free mydlink app available for your iOS or Android devices.Connect a USB storage device to your DIR-850L to create a shared storage space, making it easy to access and share files between computers and devices conn'),
