(21694, 1827, 2, 'D-Link\'s Cloud Router N300 (DIR-605L) is the first of a new generation of home routers. It allows users to monitor their home network and check on who has connected, which websites they have visited and even intrusion attempts - from anywhere, via an intuitive web portal or the mydlink app, available for iPhone, iPad and Android devices. This router is ideal for creating a secure home network for your entire family.By simply downloading D-Link\'s free mydlink iPad, iPhone or Android app, you can have full control of your home network wherever you are, no matter your level of expertise. Receive push notifications and e-mail alerts about intrusion attempts and new users. The Cloud Router is a great way to easily detect if anyone is trying to access your network without being authorized, or for concerned parents wanting to know which websites their children are visiting when at home. To ensure that your router is always up-to-date with the latest features, mydlink Cloud Services will even notify you when an update is available for your router.Connect the Cloud Router to your broadband modem and wirelessly share your high-speed Internet connection at up to 300 Mbps. Enjoy surfing the web, checking email, and chatting with family and friends online. The router uses Wireless N technology, which offers increased speed and range over the 802.11g standard. It features NAT (Network Address Translation), allowing multiple users to connect to the Internet by sharing a single IP address. The Cloud Router also includes four Fast Ethernet Ports that give you the flexibility to connect wired devices to the network.Additionally, this router features a built-in Stateful Packet Inspection (SPI) firewall to minimize the threats of hackers and intruders as well as analyzing network traffic. The router also supports WEP, WPA, and WPA2 wireless encryption to keep your network traffic secure.With the included Setup Wizard, you can set up your wireless network in minutes. The wizard '),
