Create a high-speed wireless network for your home using this ADSL2+ Router. Connect the device to a broadband modem and wirelessly share your high-speed Internet connection at speeds of up to 300 Mbps. Enjoy surfing the web, checking email, and chatting with family and friends online. The router uses Wireless N technology, which offers increased speed and range compared with earlier technology. The Wireless N ADSL2+ Modem Router also includes four Fast Ethernet ports that give you the flexibility to connect wired devices like Network Attached Storage (NAS) Enclosures to the network.Connect a USB storage device to the Wireless N ADSL2+ Modem Router to create a shared storage space, with SharePort technology, making it easy to share music, movies and documents between computers and devices connected to your network. Plug in a USB hard drive and access your library of videos and music on your laptop. You can even customize your shared storage space by creating separate accounts to control access to the USB drive, so you can share your music with everyone but keep your personal files private.With some routers, all wired and wireless traffic, including Internet calling such as Skype, video streaming, online gaming, and web browsing are mixed together into a single data stream. By handling data this way, applications such as streaming video may stutter or have an unstable connection. With the D-Link Smart Quality of Service technology, wired and wireless traffic is analyzed and separated into multiple data streams. Different applications like voice, video, '),
