(22033, 1848, 2, 'NETGEARs ProSAFE line of antennas and accessories for 802.11b, 802.11g and 802.11n devices give you multiple options for maximizing the reach and performance of your wireless infrastructure devices. Every WLAN deployment is unique. For outdoor bridging applications, the ANT224D10 enables two wireless N access points with antenna take-offs to create a high-speed wireless bridge between them with two streams of data.  By pointing two ANT224D10 antennas at each other, they can connect two wireless access points over 10,000 meters apart.  Utilizing the advantages of wireless N, the ANT224D10 provides for wireless bridging at speeds many times faster than those based on 802.11g technology.  Designed for safety, the ANT224D10 includes equipment to neutralize lighting strikes and keep your access points operational.  With wall mounting and pole mounting options, the ANT224D10 can be mounted in a variety of locations for maximum performance.'),
