(22240, 1857, 2, 'The Small Form-factor Pluggable (SFP) Gigabit interface Converter (GBIC) slots on NETGEAR\'s managed switches provide you with a highly adaptable network. You have the option of building your network for copper and/or fiber gigabit connections. Due to the automatic detection capabilities of the switch, installation of the SFP GBIC only requires that you plug the module into the module slot. Plugging an AGM731F module will disable the associated RJ-45 port.PRODUCT FEATURES:Adds fiber optic connectivity to the GSM7324;Small size for high-density fiber connections;Meets SFP GBIC standard for use with any SFP GBIC compliant slot;1000BaseSX connectivity;LC connectors;Supports both 50um and 62.5um multimode fiber cables.'),
