(22501, 1870, 2, 'The NETGEAR GS510TP Smart Switch offers support for eight 10/100/1000 Mbps autosensing and two 1000M SFP Gigabit Ethernet switching ports. Using Gigabit ports, high-speed connections can be made to a server or network backbone.The GS510TP Smart Switch also provides the benefit of administrative management with a complete package of features for the observation, configuration, and control of the network. With a web-based Graphical User Interface (GUI), the switch\'s many capabilities can be viewed and used in a simple and intuitive manner. The switch\'s management features include configuration for port and switch information, VLAN for traffic control, port trunking for increased bandwidth, and Class of Service (CoS) for traffic prioritization. These features provide better understanding and control of the network.The GS510TP Smart Switch is a free-standing switch. It is IEEE-compliant and offers low latency for high-speed networking. All ports can automatically negotiate to the high speed. This capability makes the switch ideal for environments that have a mix of Ethernet, Fast Ethernet, or Gigabit Ethernet devices. In addition, all RJ-45 ports operate in half-duplex or full-duplex mode.'),
