(22515, 1874, 2, 'Joining NETGEAR\'s ProSafe family of smart switch with high performance and cost efficiency, this 10-port Gigabit smart switch is packed with powerful features capable of enhancing any type of business network. The GS110TP is designed for customers who need a low port density solution with the combination of Gigabit speed and PoE capability. The GS110TP comes with 8 dedicated 10/100/1000 Mbps copper ports to connect to your end devices and two additional Gigabit fiber ports for uplinks with greater distance. With PoE capability on all 8 copper ports, the GS110TP can automatically detect PoE on the end devices and dynamically manage power assignments and priority. It is capable of delivering up to 15.4 W of power to devices such as wireless access points, IP phones and IP cameras, providing flexibility and ease of deployment to your network.The GS110TP comes with a comprehensive set of features, such as enhanced VLAN and QoS, access control lists (ACL), 802.1x port authentication, rate limiting and IGMP snooping and many more, to provide businesses with networks that are geared for growth while ensuring performance and reliability.With the fanless design and compact form factor, the GS110TP offers quiet operation and is suitable for deployments in any type of environment, especially the ones which are sensitive to noise.'),
