(22814, 1885, 2, 'NETGEAR\'s low-cost, stackable Gigabit Ethernet switches deliver maximum throughput and flexibility where you need it - to high-speed, high-density workgroups at the edge of the network, in the backbone of growing networks or for bandwidth-thirsty file and application servers. The ProSafe GSM7352S fully-managed switch delivers 48 ports of auto-sensing 10/100/1000 Mbps interfaces for high-density copper connectivity.The ProSafe GSM7352S has two 10 Gigabit Ethernet small form-factor pluggable (SFP+) interfaces and two high-speed, module bays offering modular expansion for 10 Gigabit Ethernet or 48 Gigabit Stacking connectivity. The non-blocking design of the switches delivers simultaneous, full wire-speed, low-latency throughput to all ports.A full suite of Layer 3 switching functionality ensures reliable routing between VLANs and network segmentation where and when you need it, at no additional cost. By configuring the switches into a stack of up to 8 units across a 48 Gbps bi-directional ring, a high-density, single IP-addressable switch can be built.Robust security features include IEEE 802.1x port-based authentication and access control lists, ensuring that only authorized users can access your network. Secure management of the switches is available through Secure Sockets Layer (SSLv3) for the Web GUI and Secured Shell (SSH) for command-line sessions or with SNMP v3 for network management software. For workgroup deployments in cost-sensitive organizations that require Layer 3 switching, additional Gigabit capacity, high-value price point, flexibility of stacking, and reduced maintenance requirements, NETGEAR\'s ProSafe Gigabit Layer 3 Stackable switches deliver the ideal access-edge solution.With their high-value price point, flexible design, and reduced maintenance requirements, NETGEAR\'s ProSafe Gigabit Layer 3 Stackable switch solutions yield a high return on investment, and are ideal for delivering highly reliable, converged voice, video, and data servic'),
