(22884, 1894, 2, 'Today\'s growing businesses demand and rely more on their network to carry out mission-critical business activities. Companies are putting more network traffic and applications on their Ethernet infrastructure. For example, the increasing deployments of VoIP phones and IP cameras require more than simple Plug-and-Play connectivity. It needs the network intelligence to separate the voice and video traffic from data, and prioritize them accordingly. Additionally, Internet-based applications such as Hotmail and Google Calendaring have made keeping the network up a business-critical need. However, companies do not necessarily have more money or advanced training to deal with complex managed switches .NETGEAR\'s ProSafe Plus switches meet this growing need by providing fundamental network features that will help optimize the performance of business networks. ProSafe Plus switches also offer traffic monitoring for users to observe traffic behavior. If there are connectivity issues, these switches can identify and even locate connection problems via cable diagnostic test. To optimize traffic through the switches, ProSafe Plus Switches offer both port and tag-based prioritization to keep latency-sensitive traffic moving ahead of less critical packets. Also, ProSafe Plus switches offer port and 802.1Q-based VLAN as a means of improving security and network performance. ProSafe Plus switches are an upgrade from the Plug-and-Play unmanaged switch, delivering great value for empowering your network, delivering great value to the end user.'),
