(23338, 1917, 2, 'The D-Link DGS-108 is a 8-port Gigabit desktop switch for the SMB and enterprise class business seeking a metal housed, Plug-and-Play solution capable of providing reliable connectivity for network users. The DGS-108 delivers power, performance, and reliability in one cost-effective, space-saving design. The metal exterior provides a durable alternative to plastic enclosures. This makes the DGS-108 a perfect solution for installation in locations such as a warehouse, automotive garage, wiring or Telco closet. In addition, the sleek and polished design of the DGS-108 adds a level of sophistication to the SMB and Enterprise network seeking to maintain the look and feel of their network all the way to the desktop.\n\nThe DGS-108 supports full duplex operation on all 8 interfaces for up to 2000Mbps per port, and a combined switching capacity of up to 16Gbps. Per-Port color LEDs clearly indicate link status and port speed for quick diagnostic and troubleshooting. It features a non-blocking switching architecture that filters and forwards packets at full wire-speed for maximum throughput. The DGS-108 combines dynamic memory allocation with store-and-forward switching to ensure that the buffer is effectively allocated for each port; and controls the data flow to guarantee against possible packet loss. The DGS-108 is scalable, allowing two or more units to be cascaded together. Additionally, the DGS-108 supports 802.3x Flow Control to minimize dropped packets through the sending out of collision signals when the ports receiving buffer is full, Jumbo Frames support up to 9.6K for reduced network load, and 802.1P priority queuing to aid in the quick and efficient delivery of critical network traffic such as voice and video.\n\nThe DGS-108 is compact and portable. With its small footprint, the DGS-108 can fit in almost any location making it the perfect solution for implementations where space is limited. In addition the DGS-108 is wall mountable, providing even more flexibility '),
