(23386, 1916, 2, 'Get the blazing speed of Gigabit Ethernet with the D-Link DGS-1016D, a 16-port 10/100/1000Mbps Switch that delivers power, performance, and reliability in one cost-effective, space-saving design. Increase the speed of your network server and backbone connections, or make Gigabit to the desktop a reality. Power users in the office, workgroup, or creative production environment can now move large, bandwidth-intensive files faster. Transfer graphics, CGI, CAD, or multimedia files across the network instantly. The versatile and compact 1RU height design of the DGS-1016D enables the device to be rackmounted in a standard 19 inch rack, while conserving valuable rack space.\n\nIt features a non-blocking switching architecture that filters and forwards packets at full wire-speed for maximum throughput. An 8K MAC address table provides scalability for even the largest networks. Address learning and aging, 802.3x Flow Control for full-duplex mode, and back pressure flow control for half-duplex mode alleviates traffic congestion and ensures reliable data transmission. Designed using industry standards, it is compatible with virtually all 10, 100, and 1000Mbps Ethernet devices and other vendor equipment. It protects your existing network investments while providing you with a straightforward migration path to faster Gigabit speeds.\n\nThe auto features of this switch make installation plug & play and hassle-free. No configuration is required. Auto-MDI/MDI-X crossover on all ports eliminate the need for crossover cables for connection to another switch or hub. Auto-Negotiation on each port senses the link speed of a network device (either 10, 100, 1000Mbps) and intelligently adjusts for compatibility and optimal performance. It also features diagnostic LEDs which display status and activity, allowing you to quickly detect and correct problems on the network. Every port also supports a cable diagnostic feature that helps to detect cable related problems.\n\nFeatures:\n 32Gbps switching'),
