(23602, 1931, 2, 'The ProSafe FS108P provides power and data from a single point, using Power over Ethernet (PoE) over a single Cat-5 cable. The eight Fast Ethernet ports can be used for any 10/100Mbps link and four of these ports can supply industry-standard IEEE 802.3af power. Advanced auto-sensing algorithm gives power only to 802.3af end devices, so no need to worry about damaging proprietary PoE or non-PoE equipment. In addition, it discontinues the power when PoE devices are disconnected. Easy and reliable, the ProSafe FS108P automatically determines PoE requirements, speed, duplex, and cable type using AutoUplink.The affordably priced ProSafe FS108P delivers PoE to any small business network that wants to simplify the installation of wireless access points and IP-based surveillance cameras. These devices are optimally installed on a ceiling or high on a wall, away from most electrical outlets. PoE eliminates the requirement for a dedicated electrical outlet to power these devices. This allows for flexibility in situating devices where AC power is difficult to access and lowers installation costs. Compact and flexible, the ProSafe FS108P is ideal for small business network that want to inexpensively use PoE to deploy wireless access points and IP-based network surveillance cameras.Choose to plug in up to eight Ethernet or Fast Ethernet devices and mix in up to four 802.3af IP-based devices like wireless access points or IP-based network surveillance cameras. Place these 802.3af-compliant devices where they belong  high up on walls and ceiling for maximum coverage  or anywhere else you need them. Power and data are carried over standard Cat-5 cabling.The standards-based ProSafe FS108P senses and adjusts for network speed and cabling type automatically, for easy integration into your existing 10/100 Ethernet network. For PoE, the switch automatically detects 802.3af compliant devices, and supplies power as needed. Front panel LEDs keep you informed of switch and PoE status.Eng'),
(23603, 1931, 5, '43222612'),
