Every networked attached storage (NAS) device from NETGEAR runs on the revolutionary ReadyNAS operating system. This custom-built OS protects stored data with XRAID2 automatic expansion and offers continuous data protection with unlimited snapshots. Real-time anti-virus and native encryption come standard while 10GbE ports are an option for certain 2U models. Designed specifically for the unique needs of business users, ReadyNAS devices utilize proprietary ReadyCLOUD technology for cloud-based discovery, provisioning and ongoing management. In addition, these devices are virtualization-ready with iSCSI support, thin provisioning capability and certification with VMware and Microsoft.'),
