(29640, 1921, 2, 'D-Link\'s DGS-1100 Series EasySmart Switches provide an affordable solution for SOHOs, small/medium-sized businesses, as well as enterprise deployments, such as in branch offices that require simple network management. The DGS-1100 Series consists of 5, 8, 16, and 24 10/100/1000 Mbps port models. The 5 and 8 port models come in a compact desktop enclosure, while the 16 and 24 port models come in a compact 11" desktop/rackmount enclosure. Two versions of the 8-port model are available - with and without Power-over-Ethernet (PoE) support. Compliant with IEEE802.3az Energy Efficient Ethernet, these switches consume less power during idle periods. They also implement D-Link Green features that detect link status and cable length and adjust power usage accordingly. Switch management can be performed through a web management interface or through the SmartConsole Utility. The DGS-1100 Series also supports Layer 2 features such as IGMP Snooping to optimize performance for multicast applications. A fanless design allows for quieter operation and provides a longer product life.'),
