(31557, 1933, 2, 'FS100 series Fast Ethernet Switches provide your LAN with high-speed, 10/100Mbps auto-sensing connectivity for as many as 5, 8, or 16 users. Just plug in your Ethernet cables, connect a power cord, and you\'re ready to go - there\'s no software to configure. Engineered without the need for internal fans, they operate silently. And each of these very compact switches is housed in a sturdy metal case for years of dependable use.The FS116 Fast Ethernet Switch features the 100Mbps switching technology in a compact form that is best for the small office marketplace at a competitive price. This switch splits the network into smaller, connected subnets for improved performance, enabling the most demanding multimedia and imaging applications.'),
