(31743, 2305, 2, 'Hands-On Review: the Fun and Productive 9.7-Inch Apple iPad Pro\n						Read More \n					\n				\n			\n		\n	\n	\n	\n	\n\n		\n		\n		\n		\n		\n			\n				\n\n\n\n\n\n\n	\n		\n	\n	\n\n\n\n				Apple returns to the classic iPad form factor with the rose gold 9.7" iPad Pro. The display features a 2048 x 1536 resolution at 264 pixels per inch (ppi). Using a DCI-P3 color space, the iPad Pro display provides a wider color gamut than standard sRGB displays. And with more available colors, the images will appear more vivid and reveal greater detail. The Retina Display delivers greater contrast, more uniform brightness, and improved energy efficiency through photo alignment technology, an oxide TFT panel, display lamination, an anti-reflective coating, and a variable refresh rate. The iPad Pro also features True Tone display, which uses advanced four-channel ambient light sensors to dynamically adjust white balance and brightness.Powering the 9.7" Retina display is the Apple A9X chip with a M9 motion coprocessor. The 3rd generation 64-bit chip can pump out desktop-class CPU performance and console-class graphics. The faster performance allows you to multitask with ease, using iOS 9 features, such as Picture in Picture, Slide Over, and Split View. Also, the iPad Pro is capable of playing three simultaneous 4K video streams in iMovie. The iPad Pro also features 128GB of storage.The rear 12MP iSight camera has an f/2.2 aperture and a True Tone flash. It can shoot Live Photos and 4K video as well as Full HD 1080p slow-motion video and panoramas up to 63MP in size. The 5MP front-facing camera allows you to FaceTime in HD with friends and family.The iPad Pro comes with iOS 9 installed, which features proactive assistance as well as powerful search and improved Siri features, all while protecting your privacy. There are the aforementioned multitasking features for iPad, which allow you to use multiple apps simultaneously, as well as improvements to built-in apps. The Notes app has been redesigned, the Maps app gives de'),
