(31834, 2308, 1, 'Netgear ProSafe GBIC Module 1000Base-LX Fiber SFP AGM732F B&H'),
(31835, 2308, 2, 'The ProSafe GBIC Module 1000Base-LX Fiber SFP from Netgear is an expansion module that adds high-density fiber connectivity to compatible Netgear devices. It installs in a SFP GBIC compliant slot and features an LC connector that is compatible with 9um single mode fiber cables. This allows for Gigabit speeds at distances of up to 6.2 miles (10 km).\n\n\n\n\n\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Fiber Connectivity via LC \n									\n								    \n										\n\n										\n												The module features an LC connector for fiber connectivity. Fiber allows you to transmit data at Gigabit speeds over much longer distances than standard copper cabling. This module is compatible with 9um single mode fiber cables.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Netgear Compatibility \n									\n								    \n										\n\n										\n												The module is compatible with the the following switches from Netgear: GSM7328S, GSM7352S, GSM7324, GSM7312, GSM7248, GSM7212, FSM7352S, FSM7328S, FSM7326P, GS748T, GS724T, GS716T, FS750T2, FS726TP, FS726T, and JGS524F.'),
