(33007, 2370, 1, 'Cisco  Cisco MGBLX1 SFP Transceiver MGBLX1 B&H Photo Video'),
(33008, 2370, 2, 'The MGBLX1 SFP Transceiver from Cisco is an easy-to-install module that provides a simple way to add an extra Gigabit Ethernet port to your Cisco Small Business or Cisco Small Business Pro Series switches. The transceiver is available for single-mode fiber-optic cabling and can support distance up to 10 kilometers (6.2 miles).\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Small Form-Factor Pluggable (SFP) \n									\n								    \n										\n\n										\n												Cisco\'s MGBLX1 transceiver is a Small Form-Factor Pluggable (SFP) unit. An SFP is an easy-to-install module that provides a simple way to add an extra Gigabit Ethernet port to your Cisco Small Business Series switches. The Cisco MGBLX1 transceiver provides fast and reliable connectivity between switches that are located on different floors or in separate office buildings. The MGBLX1 transceiver can also support both Fast and Gigabit Ethernet applications\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Long Distance \n									\n								    \n										\n\n										\n												The MGBLX1 transceiver has a reach of up to 10 kilometers (6.2 miles)'),
