(31927, 2315, 2, 'The 24-Port Stackable Gigabit Layer-2+ Managed Switch from NETGEAR is a managed, stackable Gigabit Ethernet switch with an embedded 10 Gigabit Ethernet uplink and stacking connectivity. It is suitable for all organizations considering reliable and simple 10 Gigabit Ethernet backbone architectures. The router is a component of converged voice, video, and data networking solutions, and delivers a resilient access layer in server rooms for virtualization, campus LAN environments and commercial buildings. Virtual Chassis stacking technology, including meshed stacking, scales both the entire network\'s performance and its redundancy.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Key Features and Investment Protection \n									\n								    \n										\n\n										\n												The switch comes with port-based / VLAN-based / subnet-based "static routing" only Layer-2+ versions 4 Uplink fiber (SFP) ports for Fast Ethernet or Gigabit optics Two embedded 10 Gigabit interfaces streamline network uplinks with SFP+ and 10GBase-T (RJ-45) combo ports Two supplemental 10 Gigabit I/O bays for additional uplinks or local/remote stacking, provide versatile 10 Gigabit deployment capabilities Uplink capacity per switch is 4-port 10 Gigabit total, mixing 10GBase-T (RJ-45), 10GBase-X (SFP+), 10GBase-CX4 (802.3ak) and 48 Gb/s stacking ports\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Expandable Power \n									\n								    \n										\n\n										\n												Redundant power supply functionality with one hot-swap modular power supply\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Main Software Features \n									\n								    \n										\n\n										\n												