(31996, 2316, 2, 'The N600 Wireless Dual Band Gigabit ADSL2+ Modem Router from TP-Link is an incredibly robust all-in-one device that combines the crystal clear 5 GHz band and the traditional 2.4 GHz band. With 600 Mb/s of total bandwidth, simple tasks such as sending e-mails can be handled by the 2.4 GHz band, while bandwidth-intensive tasks such as online gaming or HD video streaming can be processed by the 5 GHz band simultaneously. \nThe 4 Gigabit LAN ports allow you to access high-speed Internet connections and share them wirelessly at blazing-fast 300 Mb/s wireless speeds. With 2 multi-functional USB ports, users can share printers, files, and media across the local network or the Internet. Furthermore, this all-in-one device allows for two different connection types (ADSL or Ethernet WAN), giving users the flexibility to conveniently access the Internet.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										One-Stop Solution \n									\n								    \n										\n\n										\n												The N600 Modem Router is a multi-functional router packed into one sleek device. With an ADSL2+ Modem, NAT Router, 4-Port Switch and Wireless N Access Point, this device eliminates the need to purchase multiple devices to access and share a high-speed Internet connection.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Concurrent Dual-Band Wireless \n									\n								    \n										\n\n										\n												The router broadcasts and receives both 2.4 GHz and 5 GHz connections simultaneously. Although the traditional 2.4 GHz band provides long range and is great for everyday web surfing use, it is more susceptible to interference from wireless devices running on the same frequency. However, the 5GHz band provides faster wireless speeds and avoids much interference. This way, the 5 GHz band is just right for bandwidth-intensive tasks like online gaming and HD strea'),
