lass="tmp-reviews-pagination-show-more"><%if (nextPage <= totalPages) {%>				<div class="show-more" data-next-page="<%= nextPage %>"><a href="javascript:void(0)" data-next-page="<%= nextPage %>"><strong>Show more&nbsp;&nbsp;<i class="ficon-caret-down"></i></strong></a></div><%}%></script><div id="customer-reviews" ><div id="bv-loader"><span class="loader-large"></span></div><div id="BVRRContainer"><div id="smart-seo"></div></div><div id="BVRRSecondarySummaryContainer"></div><div id="smart-seo-permanent" hidden><meta itemprop="name" content="Sit back and watch stunning HD movies and TV shows with this Samsung 65-inch 4K Ultra HD TV with HDR. This TV provides vibrant, detailed graphics at a variety of angles, letting you enjoy your favorite content from anywhere in the room. This Samsung 65-inch 4K Ultra HD TV with HDR also includes smart TV features including games, apps and a web browser."><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Important stand information</span>\r\n            Posted by: <span itemprop="author">Pianopal</span> from:  on <meta itemprop="datePublished" content="05/07/2016">\r\n<span itemprop="description">This is a terrific TV, especially for movies. And upscaling lower res content is excellent, especially 1080p cable content and Blu-ray DVD\'s. I almost didn\'t buy this TV because all the pictures and the specifications show the feet that hold up the TV are at the far edges of the screen so it wouldn\'t fit on my table. Found out at the last minute from a Samsung rep that there are alternate slots which place the feet closer to the center of the screen. I wonder how many sales of this wonderful TV are lost because of the wide foot placement in the pictures.</span>\r\n<p>118 out of 132 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">This is THE tv to buy</span>\r\n            Posted by: <span itemprop="author">SnaggyG</span> from:  on <meta itemprop="datePublished" content="09/09/2016">\r\n<span itemprop="description">I\'ve always been a size over quality guy but when time came to replace my 65 inch 1080 tv, I wanted to go all out. I did a ton of research and this tv is as close as you are going to get to OLED or those $5k tvs, at a fraction of the cost. Seriously, spending 2,000 on a tv seemed crazy to me before, but after having this tv for a couple of weeks I feel like I got a legitimately awesome deal.&#13;\r\n&#13;\r\nIf you get this tv, take the dive and upgrade your netflix to premium so you can get HDR content. HDR is the future, and even though there isn\'t a ton of content yet, when you\'re friends come over, you are going to want to put on Marco Polo in 4k HDR to blow their minds.&#13;\r\n&#13;\r\nI haven\'t seen this in other reviews so I\'ll share it here, there are scenes in 4k HDR that are so incredible that you honestly feel like you\'re watching 3D tv without any glasses. This IS the future, and this tv should be future proof for several years with it\'s high quality HDR.&#13;\r\n&#13;\r\nI love this sweet sweet baby.</span>\r\n<p>85 out of 99 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Hold on to your socks</span>\r\n            Posted by: <span itemprop="author">norgester</span> from: Ft Lauderdale, FL on <meta itemprop="datePublished" content="06/02/2016">\r\n<span itemprop="description">After a bad experience with a high-end Sharp TV, I battled with myself over investing in another relatively expensive set. My old Panasonic plasma still worked, but was starting to lose some of its luster after 6 years. I had recently bought a 60" Samsung 1080 for another room, which is great, and decided my plasma just wasn\'t cutting it anymore. Went to Best Buy numerous times to look, kept checking the sales, and finally settled on this one. Seemed to have the best balance of price and specs.&#13;\r\nEasy setup, recognized all my devices, the remote takes a little getting used to, but works my cable box, and even my Amazon Fire, which is a Bluetooth remote system.&#13;\r\nPicture quality is outstanding, didn\'t really need much tweaking. Tremendous black levels for a non-OLED panel. ($$!)&#13;\r\nXfinity tv looks great, improved, some channels are better than others, but that\'s normal. BluRays are better than ever, even from my PS3.&#13;\r\nWill get the 4K disc player once I get my Rewards points, and expect even better BluRay performance from that.&#13;\r\nOnce the unit is set up, it powers on immediately, no warm up or logo screen, you just jump in.&#13;\r\nAnother nice feature is the EcoSensor, that adjusts the picture depending on the light level in the room. What\'s special about that is that you can adjust how much minimum backlight stays when the lights go out. Very cool.&#13;\r\nIt\'s a great set. If 65" is your size, you won\'t be disappointed.&#13;\r\nOne last thing, the Samsung logo that lights up at bottom frame when the TV is on can be turned off in the settings menu. It\'s kind of unnecessary, and distracting. You can tell if the set is OFF by the red LED standby light at the lower right of the frame anyway.&#13;\r\nThe salesperson was unaware of this when I asked.&#13;\r\nAnd kudos to Best Buy customer service, too.&#13;\r\nThe set was on sale when I bought it, but the price dropped another $100 a few days later, and they credited me with no hassles. Thanks, BB!</span>\r\n<p>32 out of 33 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Excels/exceeds in all of our requirements</span>\r\n            Posted by: <span itemprop="author">RichS</span> from:  on <meta itemprop="datePublished" content="06/11/2016">\r\n<span itemprop="description">You can really drive yourself nuts with the decision making process, but after some lengthy research both on Best Buy and other TV review/rating internet sites, we feel we\'ve struck upon the best 65" TV for our needs. &#13;\r\n&#13;\r\nWe developed our "must have" needs list to narrow down the potentials line-up. In descending oder of priority, our hit list included: 1) must have a great picture with good screen uniformity and blacks 2) within a reasonable budget, 3) great upscaling of non-HD content (since were fans of the oldies too), 4) low light reflection, 5) a set that\'s pleasing to the eye when not watching TV, and last 6) with above average sound since we would probably want to add a sound bar/system anyway.&#13;\r\n&#13;\r\nWe\'ve had the Samsung 65" KS8000 for three weeks, watching it nightly for two to three hours, and it excels/exceeds in all of our requirements. Even its sound, which is pretty amazing - I\'ve tried two quality sound bars/systems and have returned both because the sound benefit just was\'t enough to justify the added expense. &#13;\r\n&#13;\r\nI also really like the idea of the "Smart Hub" which really helps wire management to the set. &#13;\r\n&#13;\r\nOne thing I wasn\'t crazy about originally was the sets feet. We have ours sitting on a large console and I thought I wanted a set with a central pedestal to be able to hide its wires, but with the smart hub we only have three wires (power, coax and LAN) running to the set and they can be run down and secured to the back of the "feet" to where you aren\'t distracted by they hanging down from the set. Works great and looks great!&#13;\r\n&#13;\r\nOther TV\'s that in the final line up were the Vizio P-Series and Sony X850. Both are fine TV\'s but we felt for our purpose the Samsung KS8000 was the best all-around selection and we are very happy with it.</span>\r\n<p>31 out of 35 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Stunning!</span>\r\n            Posted by: <span itemprop="author">Admire24</span> from:  on <meta itemprop="datePublished" content="10/29/2016">\r\n<span itemprop="description">Oh where to start? I did research for months!!! And visited the store close to 30 times to see this TV in person and compared it to the Sony and Its counterpart but without HDR. Every time I went I loved this Samsung more &amp; more, but I kept getting asked from the helpers there...oh you\'re not getting the Sony? So to finally put all confusion to rest I downloaded 1080P trailers of some movies like civil war to see the fast movement and colors, lights out to see the blacks &amp; whites, and some animated movie to see what gaming would look like. I took the USB to Best Buy and by now everyone knows me by first name lol. The guys put in my USB and viola!! At that point there was not an ounce of concern left in my mind. I wanted to see how all the TV\'s upscaled these trailers and this Samsung UN65KSFXZA was hands down the best! I immediately brought it home and had it mounted. I\'m still mesmerized every time I watch HD content. I can\'t wait to watch more 4K content on it but it\'s hard to find much of it still, which I knew. You won\'t regret this TV. Wish I would have gotten the bigger size!</span>\r\n<p>45 out of 53 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Beautiful Design and Picture</span>\r\n            Posted by: <span itemprop="author">JediJeff</span> from:  on <meta itemprop="datePublished" content="04/20/2016">\r\n<span itemprop="description">I have owned this now for 3 weeks....Waited for this TV to become available and glad that I did. I was replacing an 8yr old Samsung 55 inch TV with this one and it was very very well worth the wait. The picture quality on 1080i resolution (cable) is wonderful. With Bluray and 4k content it is simply unbelievable. I did not need to buy any additional HDMI cables as my Audioquest Cinnamon level ones worked just fine. The slim bezel design makes it so you really just see the screen and nothing else. The sound quality from this TV\'s speakers were also surprising....much better than my older TV but I still prefer to run it through my surround setup (sonos soundbar, sub, and play 1\'s in the rear). Nice rich sound with good base levels. I was able to calibrate the TV on my own to have the picture look the way I like....everyone is different in that respect so just play around with the settings for a few weeks and you\'ll find "it". Great purchase and I would recommend.</span>\r\n<p>26 out of 29 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Awesome TV</span>\r\n            Posted by: <span itemprop="author">ShockaSmooth</span> from:  on <meta itemprop="datePublished" content="07/26/2016">\r\n<span itemprop="description">I was going back and forth between this TV and the Sony 850d and ultimately decided on this TV based on reviews and this TV simply looks better and more sleek. Overall, I am very happy with this purchase. The picture looks great and the smart functionality and responsiveness is incredible. The universal remote is solid, and I almost exclusively use this remote to control the TV, home theater system and satellite box. For the most part the picture is pretty clear. Color and contrast are great (especially after calibration) and the TV can get very bright. After spending some time adjusting the settings that have an effect on sharpness/clarity I reached a picture that yields satisfying results. Sound really isn\'t as bad as I was expecting after reading multiple reviews saying the sound isn\'t great. Overall, I am very impressed with this TV and love how easy it is to switch from TV to apps to inputs. Not to mention this TV is arguably the best looking TV as far as hardware is concerned. Definitely recommended.</span>\r\n<p>14 out of 14 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Amazing Television</span>\r\n            Posted by: <span itemprop="author">Toobin</span> from:  on <meta itemprop="datePublished" content="05/28/2016">\r\n<span itemprop="description">I was contemplating HDR vs. Non-HDR and so very glad I paid the extra for HDR. The colors &amp; contrast are incredibly vivid with this television. We have watched several movies with this set now and the picture is absolutely amazing and think that our in-person movie theatre visits will now dwindle.</span>\r\n<p>13 out of 13 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">1</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">Vertical Line on screen after 33 days</span>\r\n            Posted by: <span itemprop="author">Bobs2424</span> from:  on <meta itemprop="datePublished" content="08/09/2016">\r\n<span itemprop="description">This TV was delivered to us the first time on July 1, 2016 from the Folsom, CA store. It didn\'t work so we refused delivery. A second TV was delivered on July 6, 2016. After 33 days the TV has developed a black vertical line from the top to the bottom of the screen. We called Best Buy and spoke to Matt. Best Buy won\'t replace the TV because their return policy is 15 days. 15 DAYS. This is terrible service. We had ordered another TV from Best Buy this week for another room in our home and we are canceling that order. We won\'t be doing business with Best Buy again.</span>\r\n<p>49 out of 64 found this review helpful.</p>\r\n</div><div itemprop="reviews" itemscope="itemscope" itemtype="http://schema.org/Review">\r\n<div itemprop="reviewRating" itemscope="itemscope" itemtype="http://schema.org/Rating">\r\n<meta itemprop="worstRating" content="1">\r\n<span itemprop="ratingValue">5</span>\r\n<meta itemprop="bestRating" content="5">\r\n</div>\r\n<span itemprop="name">1st one broke, 2nd one flawless.</span>\r\n            Posted by: <span itemprop="author">Omephla</span> from:  on <meta itemprop="datePublished" content="08/03/2016">\r\n<span itemprop="description">For starters the TV is fabulous: excellent color (connected to an XBOX One S) in my brightly lit room during day, and deeply dark room at night. Motion clarity is crisp and responsive (the main reason I bought this model over 120hz variants). HDR is incredible with the right content being fed to it (Netflix, One S UHD Drive, etc.). Excellent 4k upscaling for 1080 and less signals (most cable content). I have no issues with this set. My only complaint was that the 1st one I bought did not get past the Welcome screen. After mounting, calling support (Samsung and Best Buy), driving back to Best Buy to test my remote (not the problem), it was discovered that the hardware/software on the panel was defective. Sooooo, after unmounting, repackaging, taking back to Best Buy, and exchanging for a replacement, all is well. I will not fault the TV or give a bad rating for this, since, once a working one was tested it was absolutely perfect. I cannot attest to the sound since I use a 5.1 external system.</span>\r\n<p>15 out of 16 found this review helpful.</p>\r\n</div><a href="http://www.bestbuy.com/site/samsung-65-class-64-5-diag--led-2160p-smart-4k-ultra-hd-tv-with-high-dynamic-range-silver/5065600.p?skuId=5065600&amp;reviewsPage=2">2</a><a href="http://www.bestbuy.com/site/samsung-65-class-64-5-diag--led-2160p-smart-4k-ultra-hd-tv-with-high-dynamic-range-silver/5065600.p?skuId=5065600&amp;reviewsPage=3">3</a><a href="http://www.bestbuy.com/site/samsung-65-class-64-5-diag--led-2160p-smart-4k-ultra-hd-tv-with-high-dynamic-range-silver/5065600.p?skuId=5065600&amp;reviewsPage=4">4</a><a href="http://www.bestbuy.com/site/samsung-65-class-64-5-diag--led-2160p-smart-4k-ultra-hd-