GB RAM - 256 GB SS" />Rated <span itemprop="ratingValue">4.8</span> out of <span itemprop="bestRating">5</span> by <span itemprop="reviewCount">24</span>reviewers.</span><!--end-aggregate-rating--></div><!--begin-reviews--><div id="BVRRReviewsSoiSectionID_4005923"><div id=\'131708640\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">Alfalfa</span><span itemprop="name"> Lightweight, tough, and smells nice</span><span itemprop="description"> i bought it about two months ago and have enjoyed it severely. i know its a rather insignificant detail but for me i reeeeeaally liked and appreciated the packaging and box it came in. Besides that it starts up lightning fast in about 3-6 seconds and is really easy to jump straight into. i could even do some light gaming! very nice screen and the keyboard is heavenly, sometimes i go to One Note just to to type for the sake of typing. Small yet powerful, lightweight yet tough with a smooth black finish. because of these things i\'ve received compliments from the biguns AND the littluns. also love that new laptop smell, hope it never goes away 10/10if i had to name some cons it would be that the top can catch fingerprints kinda easily sometimes and it can get really get rather expensive when getting those high end upgrades but i mean to be fair it is *high-end* u__u</span> October 21, 2016<meta itemprop="datePublished" content="2016-10-21" /></div><div id=\'131478051\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">2</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">egidro</span><span itemprop="name"> Good for Lenovo, average on market</span><span itemprop="description"> I got the top configuration version of x1 and I have mixed feeling. It has high resolution screen, but the brightness is quite poor;It has fingerprint reader that for some reason is not active when laptop is off (that was very convenient feature on my previous thinkpad);Combination with OS disaster (this is windows10 issue, not lenovo - i have 2 screens, main screen is native resolution while laptop uses 150% scaling. Even microsoft office applications look different - powerpoint does not consider scaling while word does.)I also have X1 bluetooth mouse. Unfortunatelly this combination is not funcional if you want to make most of it - use Bluetooth: it does work until first sleep and then fails to reconnect. I have replaced mouse with no success so I suspect it is laptop issue.It has 3 old-fashioned USB ports and does not have any usb-c port. It is weird.On the good side - it is very tough build laptop, good keyboard.Bottom line: Very good hardware (except screen, which is average). Poor collaboration with software manufacturer. Result - expensive, nice laptop that has many small irritating issues.</span> October 20, 2016<meta itemprop="datePublished" content="2016-10-20" /></div><div id=\'131314925\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">mlotter</span><span itemprop="name"> Great size and power</span><span itemprop="description"> I have been using this laptop for a few months. I love the light weight and slim design. With that being said you will not have a lack of power or speed. The Battery life is on a class all by itself. I recommend this laptop to anyone.</span> October 17, 2016<meta itemprop="datePublished" content="2016-10-17" /></div><div id=\'130339748\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">George_in_OC</span><span itemprop="name"> Best lightweight laptop</span><span itemprop="description"> Super light, combined with computing power, quality screen, SSD drive super fast. bought 2 years extra warranty. Forgot to buy Microsoft office in time for their discounted special within 10 days of purchase. Not sure if they removed tracking software mentioned in prior tech articles</span> October 11, 2016<meta itemprop="datePublished" content="2016-10-11" /></div><div id=\'130298617\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">Orange juice</span><span itemprop="name"> light laptop</span><span itemprop="description"> I bought this laptop a month ago and so far I didn\'t face any problems that my friends who brought sf p4 or xps15 faced. Also, it\'s as light as a book, which means it\'s easy to carry around especially if you are a student</span> October 11, 2016<meta itemprop="datePublished" content="2016-10-11" /></div><div id=\'130118102\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">Harari2016</span><span itemprop="name"> Very nice, High performance, Easy to carry Laptop</span><span itemprop="description"> I bought this Laptop 3 months ago and I am very happy with it. Very nice, easy and comfortable to use, and very high performance. The battery lasts forever which is very important for me too.</span> October 9, 2016<meta itemprop="datePublished" content="2016-10-09" /></div><div id=\'129994969\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">hhhll</span><span itemprop="name"> Great PC</span><span itemprop="description"> I bought this about a month ago and it performs great so far.</span> October 8, 2016<meta itemprop="datePublished" content="2016-10-08" /></div><div id=\'142673203\' itemprop="review" itemscope itemtype="http://schema.org/Review"><meta itemprop="itemReviewed" content="Lenovo ThinkPad X1 Carbon 20FB - 14&amp;quot; - Core i7 6600U - 8 GB RAM - 256 GB SS" /><span itemprop="reviewRating" itemscope itemtype="http://schema.org/Rating">Rated <span itemprop="ratingValue">5</span> out of <span itemprop="bestRating">5</span></span> by <span itemprop="author">Joey33</span><span itemprop="description"> X1 Carbon\'s are a fantastic high-end ultrabook. We bought a bunch for our executive/senior leadership staff and have never had a complaint. We originally bought the Gen 1\'s a couple of years ago but are now onto the Gen 3\'s and have several hooked up to the OneLink Pro docks.</span> April 15, 2016<meta itemprop="datePublished" content="2016-04-15" /></div> </div><script type="text/javascript">document.getElementById(\'BVRRReviewsSoiSectionID_4005923\').style.display = \'none\';</script><!--end-reviews--> <ul id="BVSEOCPS_GEN" style="display:none;"><li id="bvDateModified">2016-10-30</li><li id="bvPL">bvseo-cps-pl-PRR</li></ul></div><ul id="BVSEO_meta" style="display:none!important"><li data-bvseo="bvDateModified">2016-10-30 T09:47:30.295-05:00</li><li data-bvseo="ps">bvseo_lps, prod_bvrr, vn_prr_5.6</li><li data-bvseo="cp">cp-1, bvpage1</li><li data-bvseo="co">co_hasreviews, tv_24, tr_24</li><li data-bvseo="cf">loc_en_US, sid_4005923, prod, sort_default</li></ul><!--begin-pagination--><div class="BVRRPager BVRRPageBasedPager"><span class="BVRRPageLink BVRRPageNumber"> <a data-bvjsref="http://reviews.cdw.com/0058-en_us/4005923/reviews.djs?format=embeddedhtml&amp;page=2&amp;scrollToTop=true" data-bvcfg="__CONFIGKEY__" href="javascript://" title="2" class="BVPageLink">2</a></span><span class="BVRRPageLink BVRRPageNumber"> <a data-bvjsref="http://reviews.cdw.com/0058-en_us/4005923/reviews.djs?format=embeddedhtml&amp;page=3&amp;scrollToTop=true" data-bvcfg="__CONFIGKEY__" href="javascript://" title="3" class="BVPageLink">3</a></span><span class="BVRRPageLink BVRRNextPage"><a data-bvjsref="http://reviews.cdw.com/0058-en_us/4005923/reviews.djs?format=embeddedhtml&amp;page=2&amp;scrollToTop=true" data-bvcfg="__CONFIGKEY__" href="javascript://" title="next" class="BVPageLink">next</a></span><span class="BVRRPagerArrows">&gt;&gt;</span> </div><!--end-pagination--></div><meta charset="UTF-8" />\r\n    </div>\r\n    \r\n</div>\r\n<!-- End Reviews -->\r\n\r\n				</div>\r\n			</div> \r\n<input type="hidden" name="ctl00$ctl00$MainContentRoot$Body$URV$cpDynamic_ClientState" id="ctl00_ctl00_MainContentR