entative" id="Representative" class="txt-surname" value="" />\r\n                </div>\r\n\r\n                \r\n\r\n                <div class="form-controls">\r\n                    <button type="submit" class="btn btn-quote-request blueButton">Submit</button>\r\n                </div>\r\n                <div id="formCopy" class="form-copy">\r\n                    An account manager will email you within one business day to confirm your request.\r\n                </div>\r\n            </form>\r\n        </div>\r\n    </div>\r\n    <!-- Thanks Panel -->\r\n    <div id="quoteRequestThanks" class="quote-thanks">\r\n        <div>\r\n            <h3 class="title">Your Quote has been submitted</h3>\r\n            <div class="gray-box">\r\n                <p><strong>What Happens Next?</strong> <span class="body-copy">A confirmation email is on its way. Within one business day, you will be contacted by an Account Manager to finalize your quote.</span></p>\r\n                <img id="survey-utility-application" src="" width="1" height="1" />\r\n            </div>\r\n\r\n            <!-- Form Details -->\r\n            <div class="plan-details"></div>\r\n        </div>\r\n    </div>\r\n    <!-- Error Panel -->\r\n    <div id="quoteRequestError" class="quote-error">\r\n        <div>\r\n            <h3>Error!</h3>\r\n            <strong>Something went wrong.</strong><br />\r\n            <p>Please try again later.</p>\r\n        </div>\r\n    </div>\r\n</div>\r\n\r\n    \r\n\r\n<!-- License Selector Modal -->\r\n<div id="license-modal">\r\n	<a href="#" class="ico-x" id="close-license-modal"></a>\r\n	<div class="layout">\r\n		<h1>License Selector</h1>\r\n		<div class="layout-7">\r\n			<div class="box">\r\n				<strong id="selector-title"></strong>\r\n				<div id="selection-list"></div>\r\n				<div class="buttons">\r\n					<a href="#" class="-disabled js-previous"><span class="ico-chevron-left"></span>Back</a>\r\n					<a href="#" class="-disabled js-next">Continue<span class=