:hover{cursor:pointer;}\r\n	#freeShippingMap .freeShippingCloseBtn{\r\n		width:60px;\r\n		height:30px;\r\n		border-radius:40px;\r\n		border:1px solid #d9dadb;\r\n		display: block;\r\n		text-align: center;\r\n		padding-top: 4px;\r\n		font-size: 12px;\r\n		margin-top: 40px;\r\n	}\r\n	#freeShippingWrapper .displayNone,\r\n	#freeShippingWrapper.displayNone,\r\n	.shippingZipWrapper .displayNone{\r\n		display:none;\r\n	}\r\n	.shippingZipError{\r\n		color:#9b2f18;\r\n		font-size:14px;\r\n		float:left;\r\n		width:100%;\r\n		padding-top:10px;\r\n	}\r\n	#freeShippingWrapper .freeShippingContainer .shipDest.needZipChange{\r\n		color:gray;\r\n		text-decoration:underline;\r\n		font-size:14px;\r\n	}\r\n	#freeShippingWrapper .shipDay{\r\n		float:left;\r\n	}\r\n	#details-page #freeShippingWrapper {\r\n		/*margin-bottom:20px;*/\r\n	}\r\n	.shipTimerText{\r\n		float:left;\r\n	}\r\n	input[type=\'text\'].shippingZipInput::-webkit-input-placeholder { font-size:14px !important; } \r\n	input[type=\'text\'].shippingZipInput::-ms-input-placeholder { font-size:14px !important; }\r\n	input[type=\'text\'].shippingZipInput::-moz-input-placeholder { font-size:14px !important; }\r\n	/*input[type=\'text\'].shippingZipInput:focus::-webkit-input-placeholder{color: transparent!important;}*/\r\n	/*input[type=\'text\'].shippingZipInput:focus::-moz-placeholder{color: transparent!important;}*/\r\n	/*input[type=\'text\'].shippingZipInput:focus:-moz-placeholder{color: transparent!important;}*/\r\n</style>\r\n\r\n\r\n\r\n<div id="freeShippingWrapper" class="displayNone">\r\n	<div class="freeShippingContainer" data-deliverby="">\r\n		<div class="freeShippingMsgWrapper">\r\n			<div class="shipEst">\r\n				<span class="shipTransitTime"></span> \r\n				<span class="shipDest"></span>\r\n			</div> \r\n			<div class="shipGraphic"></div> \r\n			<div class="shipOrderWhen">\r\n				<span class="shipTimerText"></span>\r\n				<span class="shipTimer"></span>\r\n				 <span class="shipDay"> </span>\r\n			</div>	\r\n			<div class="shipDetails">see details <span class="shipChev"></span></div>\r\n			\r\n				\r\n					<span class="returnPolicy">Extended Returns</span> \r\n					<div class="returnDetail">Details <span class="shipChev"></span></div>\r\n				\r\n			\r\n		</div>\r\n	</div>\r\n	<div id="freeShippingMap">\r\n		<div class="freeShippingMapWrapper">\r\n			<img src="/images/freeShipMap_3.png">\r\n		</div>\r\n		<div class="freeShippingMapText">\r\n			Most orders* over <b>$49</b> qualify for <span class="freeShippingMapShipText"></span>.<br>\r\n			<br>\r\n			Orders placed after 4PM on weekdays will not ship until the next business day. Orders placed after 11AM Fridays will not ship until the following Monday. <br>\r\n			Faster shipping methods may be available; just upgrade during checkout.<br>\r\n			<br>\r\n			*Some exclusions apply.<br><br>\r\n			<span class="freeShippingCloseBtn">Close</span>\r\n		</div>\r\n	</div>\r\n	\r\n	<div class=\'extendedReturnDetailWrapper\'>\r\n		<div id="extendedReturnDetail">\r\n			<h3 class=\'c41 fs20 returnDetailHeader\'>Enjoy Extended Returns thru Feb 1, 2017!</h3>\r\n			<p class=\'returnDetailText\'>You have until Feb 1, 2017 to return or exchange items purchased between Nov 1, 2016 and Jan 1, 2017. <br>All other <a href="https://www.bhphotovideo.com/find/HelpCenter/ReturnExchange.jsp" class="returnPolicyLink">standard return policy</a> conditions apply.</p>\r\n			<p class=\'returnDetailClose\'>Close</p>\r\n		</div>\r\n	</div>\r\n	\r\n</div>\r\n\r\n<div class="shippingZipWrapper">\r\n	<div class="shippingZipBG"></div>\r\n	<div class="shippingZipLayer">\r\n		<div class="shippingMsg">\r\n			<div class="shippingLocationMsg">\r\n				Shipping Location\r\n			</div>\r\n			<div class="shippingText">\r\n				Enter new zip code to refresh estimated delivery time.\r\n			</div>\r\n			<div class="shippingZipEnterWrapper">\r\n				<input type="text" class="shippingZipInput" placeholder="Enter Zip">\r\n				<div class="shippingZipButton">Update</div>\r\n			</div>\r\n			<div class="shippingZipError displayNone">\r\n				Unrecognized Zip Code\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<script>\r\n	(function(document){\r\n		var shippingWrapper = document.getElementsByClassName("shippingZipWrapper")[0];\r\n		var freeShippingMap = document.getElementById("freeShippingMap");\r\n		var shipDest=function(){\r\n			if(shippingWrapper.className.indexOf("changeZip")!==-1){\r\n				shippingWrapper.classList.remove("changeZip");\r\n			}else{\r\n				shippingWrapper.classList.add("changeZip");\r\n				document.getElementsByClassName("shippingZipInput")[0].focus();\r\n			}\r\n		}\r\n		var shippingZipButton=function(){\r\n			var $error = $(".shippingZipError");\r\n			$error.addClass("displayNone");\r\n			var inputZip = $(".shippingZipInput").val();\r\n			var isZip = /^\\d{5}$/.test(inputZip);\r\n			if(!isZip){\r\n				$error.removeClass("displayNone");\r\n				return false;\r\n			}\r\n			$(document).trigger("updateZipDetail",{zip:inputZip});\r\n			$(".shippingZipInput").val("");	\r\n			getShippingData(inputZip);\r\n\r\n		}\r\n		var showShipMap = function(){\r\n			if(freeShippingMap.className.indexOf("showMap")!==-1){\r\n				freeShippingMap.classList.remove("showMap");\r\n			}else{\r\n				freeShippingMap.classList.add("showMap");\r\n			}	\r\n			\r\n			$(\'#extendedReturnDetail, .extendedReturnDetailWrapper\').hide();\r\n			\r\n		}\r\n\r\n		var ShipTimer = {\r\n			init: function($el){\r\n				if (this.activeShipTimer) {\r\n					this.activeShipTimer.destroy();\r\n				}\r\n				\r\n				var deliveredBy = $el.data(\'deliverby\');\r\n				var cutoffDataArray = deliveredBy.data;\r\n				var cutoffHour = deliveredBy.cutoffHour;\r\n				var cutoffTimes = [deliveredBy.cutoffTime, deliveredBy.nextCutOfftime];\r\n				var setTimer = function(){\r\n					if(cutoffDataArray) {\r\n						/*\r\n						var cutoffData = cutoffDataArray[0];\r\n						// var cutoffHour = 2;//cutoffData.cutoffHour;\r\n						$el.find(\'.js-deliveryDate\').html(cutoffData.preferredMethod.deliveryDate);\r\n						$el.find(\'.js-preffered-name\').html(cutoffData.preferredMethod.name);\r\n						if(cutoffData.fasterMethod) {\r\n							$el.find(\'.ship-sooner-date\').html(cutoffData.fasterMethod.deliveryDate);\r\n						}\r\n						*/\r\n					}\r\n					this.activeShipTimer = BH.globals.addTimeCountdown({\r\n						endTime: (cutoffTimes[0] - 1000),\r\n						onTick: function(timeObject){\r\n							// console.log(timeObject);\r\n							ShipTimer.update( timeObject, cutoffTimes, $el, cutoffHour );\r\n						},\r\n						onEnd: function(){\r\n							cutoffTimes.shift();\r\n							if(cutoffDataArray){\r\n								cutoffDataArray.shift();\r\n							}\r\n							setTimer();\r\n						}\r\n					});\r\n					\r\n				};\r\n				setTimer();\r\n			},\r\n			activeShipTimer: undefined,\r\n			update: function(timeObject, cutoffs, $element, cutoffHour){\r\n				// console.log("UPDATE : ",timeObject,cutoffs,$element,cutoffHour);\r\n				if(!cutoffs.length) return;\r\n				var shipDay = \'\',\r\n				    twoHours = 7200000,\r\n					showCountdown = false,\r\n					now = timeObject.currentTime,\r\n					daysDiff = ShipTimer.daysDiff(cutoffs[0], now);\r\n			        if (daysDiff === 0){\r\n					shipDay = "today";//translate(\'today\');\r\n					if(cutoffs[0]-now < twoHours)\r\n						showCountdown = true\r\n					}else if (daysDiff >= 1){\r\n					$element.find(".shipTimerText").addClass("displayNone");\r\n					$element.find(\'.shipDay\').addClass("displayNone");\r\n			        }\r\n				// console.log("daysDiff",daysDiff,"shipday : ",shipDay,"showCountdown",showCountdown,"cutoffHour:",cutoffHour);\r\n				if(showCountdown) {\r\n					var rv = ShipTimer.print(timeObject.millisRemaining);\r\n					$element.find(\'.shipTimerText\').html("Order in the next ");\r\n					// console.log(rv.timer);\r\n					$element.find(\'.shipTimer\').html(rv.timer);\r\n					// if(!cutoffHour)\r\n						// $element.find(\'.shipDay\').text(shipDay);\r\n				}else {\r\n					if(cutoffHour){\r\n						// $element.find(\'.shipDay\').html(shipDay);\r\n						$element.find(\'.shipTimerText\').html("Order by "+cutoffHour+" ET");\r\n						$element.find(".shipTimer").addClass("displayNone");\r\n					}\r\n				}\r\n\r\n			},\r\n\r\n			print: function(milisecsTo){\r\n				\r\n				var rv = {}, \r\n					secs = parseInt((milisecsTo / 1000)),\r\n					mins = parseInt((secs / 60)),\r\n					hours = parseInt(mins / 60);\r\n				\r\n				rv.timer = (hours > 0 ? hours + ":" : "");\r\n				rv.hoursOrMinutes = hours > 0 ? "hours" : "minutes";\r\n				\r\n				rv.timer += ((mins % 60 + "").length == 2 ?  mins % 60 : "0" + mins % 60) + ":";\r\n				rv.timer += ((secs % 60 + "").length == 2 ?  secs % 60 : "0" + secs % 60);\r\n				\r\n				return rv;\r\n			},\r\n\r\n			daysDiff : function(laterDateMillis, earlierDateMillis){\r\n				\r\n				var earlierDate = new Date(earlierDateMillis).setHours(0, 0, 0, 0),\r\n					laterDate = new Date(laterDateMillis).setHours(0, 0, 0, 0);\r\n				\r\n				return Math.round( (laterDate - earlierDate) / 86400000 );\r\n			}\r\n\r\n		}\r\n		var updateTransit=function(transitTime,hasZip,hasShippingTomorrow,city){\r\n			var $el = $(".freeShippingContainer");\r\n			switch(transitTime){\r\n				case 1 : \r\n					$el.find(".shipTransitTime").html("Free Next Day Shipping* to ");\r\n					\r\n					// console.log("hasShippingTomorrow",hasShippingTomorrow);\r\n					$el.find(".shipTimer").removeClass("displayNone");\r\n					$el.find(".shipTimerText").removeClass("displayNone");					\r\n					if(hasShippingTomorrow){\r\n					\r\n						$el.find(\'.shipDay\').removeClass("displayNone").text(", get it Tomorrow");\r\n					}\r\n					// }else{\r\n						// $el.find(\'.shipDay\').removeClass("displayNone").text("");\r\n					// }\r\n					$(".freeShippingMapShipText").html("Free Next Day Shipping (1 business day) to "+city);\r\n				break;\r\n				case 2 : \r\n					$el.find(".shipTimerText").removeClass("displayNone");\r\n					$el.find(".shipTransitTime").html("Free 2-Day Shipping* to ");\r\n					$el.find(\'.shipDay\').addClass("displayNone");\r\n					$el.find(".shipTimer").removeClass("displayNone");\r\n					$(".freeShippingMapShipText").html("Free 2-Day Shipping (2 business days) to "+city);\r\n				break;\r\n				default : \r\n					$el.find(".shipTransitTime").html("Free Expedited Shipping* to ");\r\n					$el.find(\'.shipDay\').addClass("displayNone");\r\n					$el.find(".shipTimerText").addClass("displayNone");\r\n					$el.find(".shipTimer").addClass("displayNone");\r\n					$(".freeShippingMapShipText").html("Free Expedited Shipping (3 business days) to "+city);\r\n				break;													\r\n			}			\r\n		}\r\n\r\n		var getShippingData=function(zipCode){\r\n			var zip=zipCode||"";\r\n			var url = BH.constants.findUrl + "json/getDeliveredBy.jsp&zip="+zip;\r\n			$.get(url).done(function(data){\r\n				if(data.status=="error"){\r\n					if(data.isApoState){\r\n						$(".shippingZipError").html("Not available for this ZIP code").removeClass("displayNone");\r\n					}else{\r\n						$(".shippingZipError").html("Unrecognized Zip Code").removeClass("displayNone");\r\n					}\r\n				}else{\r\n					if(shippingWrapper.className.indexOf("changeZip")!==-1){\r\n						document.getElementsByClassName("shippingZipBG")[0].click();\r\n					}\r\n					var $el = $(".freeShippingContainer");\r\n					$el.data("deliverby",data);\r\n					if(data.city){\r\n						$el.find(".shipDest").removeClass("needZipChange").html(data.city.substring(0,data.city.length-4));\r\n					}else{\r\n						$el.find(".shipDest").html("change ZipCode").addClass("needZipChange");\r\n					}\r\n					updateTransit(data.transitTime,(zipCode?true:false),data.hasShippingTomorrow,(data.city ? data.city.substring(0,data.city.length-4) : ""));\r\n					ShipTimer.init($el);\r\n					$("#freeShippingWrapper").removeClass("displayNone");\r\n				}\r\n			});			\r\n		}\r\n		document.getElementsByClassName("shipDest")[0].addEventListener("click", shipDest,false);\r\n		document.getElementsByClassName("shippingZipBG")[0].addEventListener("click", shipDest,false);\r\n		document.getElementsByClassName("shippingZipButton")[0].addEventListener("click", shippingZipButton,false);\r\n		document.getElementsByClassName("shipDetails")[0].addEventListener("click", showShipMap,false);\r\n		document.getElementsByClassName("freeShippingCloseBtn")[0].addEventListener("click", showShipMap,false);\r\n		var waitForJqueryReady = function(){\r\n			if(window.jQuery && BH && BH.globals && BH.constants){\r\n				$(document).on("updateZipBanner",function(e,data){\r\n					getShippingData(data.zip);\r\n				});\r\n				getShippingData();\r\n				$(".shippingZipInput").keydown(function (e) {\r\n					// console.log(e.keyCode);\r\n					if($(this).val().length>4 && e.keyCode==13){//respond to enter\r\n						document.getElementsByClassName("shippingZipButton")[0].click();\r\n						e.preventDefault();\r\n						return;						\r\n					}\r\n					if($(this).val().length>4 && e.keyCode!=8 && e.keyCode!=46){ //make sure you can backspace\r\n						$(this).val("");\r\n						return;\r\n					}\r\n					if ($.inArray(e.keyCode, [46, 8, 9, 27, 13, 110]) !== -1 || (e.keyCode == 65 && e.ctrlKey === true) || (e.keyCode == 67 && e.ctrlKey === true) || (e.keyCode == 88 && e.ctrlKey === true) || (e.keyCode >= 35 && e.keyCode <= 39)) {\r\n						return;\r\n					}\r\n					if ((e.shiftKey || (e.keyCode < 48 || e.keyCode > 57)) && (e.keyCode < 96 || e.keyCode > 105)) {\r\n						e.preventDefault();\r\n					}\r\n				});\r\n			}else{\r\n				setTimeout(function(){waitForJqueryReady()},100);\r\n			}\r\n		}\r\n		waitForJqueryReady();\r\n		\r\n		lazyLoad.lazyRunJs(function(){\r\n			$(\'.returnDetail, .returnDetailClose\').on(\'click\', function(){\r\n				if(freeShippingMap.className.indexOf("showMap")!==-1){\r\n					freeShippingMap.classList.remove("showMap");\r\n				}\r\n				$(\'#extendedReturnDetail, .extendedReturnDetailWrapper\').toggle();\r\n			});\r\n		});\r\n		\r\n	})(document);\r\n</script>\r\n	\r\n	\r\n	\r\n	\r\n</header>\r\n\r\n<script type="text/template" class="accountNotifications">\r