 js-ww-facebook"><svg class="wishwin-closer"><use xlink:href="#facebook"></use></svg>Share on  Facebook</span>\r\n			</p>\r\n			<p class="wishlist-winner fs16 c2"><span class="bold">\r\n			<svg class=\'wish-win-present-small\'><use xlink:href="#presentBox"></use></svg>\r\n			Congrats to our winners so far</span> &mdash; Lauren K. &amp; Daniel M.</p>\r\n			<p class="ww-text ww-terms fs14 smbold">Official Rules\r\n				<svg class=\'ww-terms-svg\'><use xlink:href="#chevron-thin-right"></use></svg>\r\n			</p>\r\n			<div class="ww-terms-wrapper fs12">\r\n				<span class="bold fs14">OFFICIAL B&amp;H $1,000.00 GIVEAWAY RULES</span><br><br>\r\n				<span class="bold">NO PURCHASE IS NECESSARY TO ENTER OR WIN. </span>The B&amp;H $1,000.00 Giveaway (the "Giveaway" or "Sweepstakes") is void where prohibited by law and is sponsored by B&amp;H Foto &amp; Electronics Corp., 440 Ninth Avenue, New York, NY 10001 ("Sponsor"). It is not sponsored or endorsed by Facebook or Twitter in any way.<br><br>\r\n				<span class="bold">Entry Period/Methods of Entry. </span>The Sweepstakes will run from on or about November 7, 2016 until on or about December 19, 2016 (the "Entry Period"). Entries received outside the Entry Period are void. Enter the Sweepstakes via either one of the following methods. (1) Share your most wanted item on Facebook or Twitter via the dedicated links found on the B&amp;H Website (www.bhphoto.com); or (2) Mail a postcard (postmarked during the Entry Period) containing your name, address, phone number, and email address, and indicate the subject(s), if any, about which you are interested in receiving future emails from B&amp;H (e.g. photo, video, audio, computers, home theater, portable entertainment ) (optional) to: B&amp;H $1,000.00 Giveaway, c/o B&amp;H Foto &amp; Electronics Corp., 440 Ninth Avenue, New York, NY 10001 (either option, an "Entry").  Entries must not, in the sole and absolute discretion of the Sponsor, contain obscene, provocative, defamatory, sexually explicit, or otherwise objectionable or inappropriate content. Entries deemed by Sponsor to be inappropriate will be disqualified. Entries owned by a third party, or the use of any trademarks, service marks, logos, brands, or products owned by a third-party are not acceptable for entry into the Sweepstakes. Limit 1 entry per person, per day.<br><br>\r\n				<span class="bold">Winner Selection/Prizes/Odds. </span>The B&amp;H Social Team will randomly select a winner from among all eligible entries every Monday during the Entry Period, for a total three (3) winners (each a "Winner"). Each Winner will receive a B&amp;H Gift Card pre-valued in the amount of $1000.00. No cash or other substitutions will be offered. Winner selection is in the sole and absolute discretion of the B&amp;H Social Team. Any taxes are the sole responsibility of the winner. Winners will be notified and receive their prize to the e-mail address associated with the account to which their Entry was posted or the email account provided with a mail-in entry. The odds of winning depend on the number of eligible entries received.<br><br>\r\n				<span class="bold">Identity of Winners/Eligible Participants. </span>Winners will be identified by the e-mail account associated with the Facebook or Twitter account from which their Entry was submitted or the email account provided with a mail-in entry. An e-mail account holder shall mean the natural person assigned to such e-mail account by the internet access or online service provider or other organization responsible for assigning e-mail addresses for the domain associated with such e-mail account. Any issues regarding the identity of a Winner shall be resolved by Sponsor in its sole discretion. The Sweepstakes is only open to residents of the United States that are at least eighteen (18) years of age on their entry date and is not open to employees of Sponsor, their immediate family, any person domiciled with such employees, or any affiliates or subsidiaries of Sponsor.<br><br>\r\n				<span class="bold">Entry Ownership/Entrant Agreements. </span>Entrants retain full ownership and copyrights to their Submission. However, by entering the Sweepstakes entrants grant Sponsor permission to use their Entries for promotional purposes on their respective social media channels with proper credit. Entrants also agree: (a) to be bound by these Official B&amp;H $1,000.00 Giveaway Rules; (b) that any claims related to this Sweepstakes shall be resolved individually without resort to any form of class action and that awards, shall be limited to actual out-of-pocket costs incurred in entering the Sweepstakes, and shall not include incidental or consequential damages or attorneys fees; and (c) that any actual or perceived ambiguities in these rules shall be interpreted by Sponsor in their sole discretion.<br><br>\r\n				<span class="bold">Limitation of Liability/Sponsor Modification/Cancellation Rights/ Choice of Law/ Venue/ Winners List. </span>Sponsor is not responsible for incomplete entries or for failure to receive entries due to technical failures or human error of any kind. Winners agree that Sponsor will have no responsibility for losses or damage of any kind resulting from the acceptance, possession, or use of the prizes. Except where prohibited, participation in the Sweepstakes constitutes entrant\'s consent to the publication of his or her name by Sponsor in any media for commercial or promotional purposes without limitation or further compensation subject to Sponsor\'s respective Privacy Policies. Sponsor may modify or discontinue the Sweepstakes at any time and may disqualify from the Sweepstakes any person it determines, in its sole discretion, to have attempted to or actually tampered with or otherwise abused any aspect of the Sweepstakes. Entrants agree that in the unlikely event a dispute arises in connection with this Sweepstakes, it will be governed by the laws of the State of New York and heard exclusively in a court of applicable jurisdiction in the County and State of New York irrespective of any choice of law provisions to the contrary. To receive names of the winners by U.S. mail, please mail a self-addressed stamped envelope to: B&amp;H Foto &amp; Electronics Corp., Attn: B&amp;H $1,000.00 Giveaway, 440 Ninth Avenue, New York, NY 10001. Any Winners List request must be received by B&amp;H within one (1) year of the date the Sweepstakes is conducted.\r\n			</div>\r\n		</div>\r\n		<div class="ww-email">\r\n		 	<h4 class="fs20 smbold c2">Let us know how to reach you if you win!</h4>\r\n		 	<p class="fs12 ww-text">Privacy 100% guaranteed; email address for contact purposes only</p>\r\n	 		<form class="ww-text ww-email-form">\r\n	 			<span class="fs14">Email</span>\r\n	 			<input class="ww-input" required type="email" name="email">\r\n	 			<input class="ww-buttons" type="submit" value=\'Submit\'>\r\n	 		</form>\r\n		 	<p class="fs15 c41">Already have a B&amp;H account? Just log in tomorrow to enter again!</p>\r\n		</div>\r\n	</div>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n		<script type="text/javascript" src="https://www.bhphotovideo.com/find/javascripts.jsp?files=wishAndWin.js&min=Y&vr=-1690753766"></script>\r\n	\r\n	<script type="text/javascript">\r\n		lazyLoad.setOdUrl("https://www.bhphotovideo.com/find/javascripts.jsp&min=Y&v=release20161201v10t161432161432&module=");\r\n	</script>\r\n\r\n	\r\n\r\n\r\n			\r\n		\r\n		\r\n\r\n		\r\n\r\n		\r\n\r\n		<div class="pPriceZoneRight fs14 c28 js-priceZone " data-selenium="PriceZoneRight" itemtype="http://schema.org/Offer" itemscope="" itemprop="offers" >\r\n			\r\n				\r\n				\r\n			\r\n\r\n				\r\n					\r\n						\r\n						\r\n						\r\n							<meta content="NewCondition" href="http://schema.org/OfferItemCondition" itemprop="itemCondition"/>\r\n						\r\n					\r\n\r\n\r\n					\r\n						\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n	<div class="pPrice" data-seleniu