ter " data-sectionTab="accessories" data-selenium="navAccessories">\r\n												<a href="#ac" rel="nofollow" data-selenium="accessoryIntermediateTab" onclick="cmCreateElementTag(\'DEI75593763B-REG\',\'MAIN:Prod:Tab Accessories\');" class="">\r\n													<span>Accessories</span>\r\n													<span class="navDownArrowIcon"><svg><use xlink:href="#arrow-down-light"></use></svg></span>\r\n												</a>\r\n											</li>\r\n										\r\n									\r\n								\r\n								\r\n								<li class="empty-li">\r\n									<a id="scrollTop" class="scrollTop-wrapper right clearfix cursor-pointer" href="javascript:void(0)"> \r\n										<span class="scrollTopIcon"> <svg><use xlink:href="#arrow-up-light"></use></svg></span> \r\n										<span class="smbold upper fs14">to top</span>\r\n									</a>\r\n								</li>\r\n								\r\n							</ul>\r\n						</div>\r\n					</div>\r\n\r\n					<!-- Start bottomBodyWrapper -->\r\n					<div class="bottomBodyWrapper clearfix"	data-selenium="bottomBodyWrapperPage">\r\n						\r\n						\r\n								<div id="ov" class="section-wrapper mainTabs" data-section="overview">\r\n									<div id="Overview" class="section-inner-wrapper new-page-width" data-selenium="OverviewBody">\r\n										<div class="inner-wrapper clearfix ">\r\n											<div class="leftTimeline  js-leftOverviewTimeline">\r\n												<ul class="tickerList">\r\n													<li data-tickertrigger="ov-ft-1"><span>1</span><span class="trWrap"><span class="ticker">Description</span></span></li>\r\n												</ul>\r\n											</div>\r\n											<div class="leftPanel">\r\n												\r\n													\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div class="featureWrapper bulletlist clearfix" data-selenium="featureWrapper">\r\n\r\n	\r\n	\r\n	\r\n	\r\n		<div class="primaryExploraBanner">\r\n			<div class="detailPageBanners">\r\n				<a href="https://www.bhphotovideo.com/explora/computers/hands-review/best-gaming-laptop-budget-ever"  class="js-openSlideInTray">\r\n					<div class="bannerSqImgLeft">\r\n						<img class="js-lazyImage" src="https://static.bhphoto.com/images/itemImgPlaceholder.jpg" data-src="https://static.bhphotovideo.com/explora/sites/default/files/cs-dell-gaming-laptop.jpg"/>\r\n					</div>\r\n					<div class="bannerDescRight">\r\n						<p>The Best Gaming Laptop on a Budget  Ever</p>\r\n						<div><span class="readMoreButton">Read More <span class="readMoreRightArrow"><svg><use xlink:href="#right-arrow"></use></svg></span></span></div>\r\n					</div>\r\n				</a>\r\n			</div>\r\n		</div>\r\n	\r\n	\r\n	\r\n	\r\n\r\n		\r\n		\r\n		\r\n		\r\n		<div class="ov-wrapper js-overview-desc">\r\n			<div class="ov-desc">\r\n				\r\n\r\n\r\n\r\n\r\n\r\n\r\n	\r\n		\r\n	\r\n	\r\n\r\n<script type="text/javascript" src="//players.brightcove.net/1661991858001/N1cfLQmFe_default/index.min.js"></script>\r\n\r\n				<span>Experience Full HD on the black <b>Dell 15.6&quot; Inspiron 15 7000 Gaming Series Notebook</b>. The In-Plane Switching (IPS) display features wide viewing angles, vivid colors, and a native resolution of 1920 x 1080, which means it can play Full HD content natively. The visuals are handled by the dedicated NVIDIA GeForce GTX 960M graphics card with 4GB of GDDR5 VRAM. You can also output to an external display via HDMI.</p><p>The system is powered by a 6th-gen 2.6 GHz Intel Core i7-6700HQ Quad-Core processor and 16GB of 1600 MHz DDR3L RAM that lets you efficiently multitask as well as quickly access frequently used files and programs. When you need more processing power, the CPU\'s core clock can reach up to 3.5 GHz with Intel Turbo Boost technology. For storage, this system is equipped with a 1TB hard drive with an 8GB SSD cache that provides ample room for all your files, programs, and games.<br /> <br /> Furthermore, you\'ll be able to pair additional peripherals and accessories with Bluetooth 4.0 technology. Connect to the Internet via 802.11ac Dual-Band Wi-Fi or the Gigabit Ethernet port for a more reliable and stable wired connection. Dual-Band Wi-Fi enables you to connect to the 5GHz band for faster speeds. The operating system installed in this notebooks is Windows 10 Home (64-bit). Windows 10 Home (64-bit) is the installed operating system.</span>\r\n			</div>\r\n		</div>\r\n		\r\n\r\n		\r\n\r\n	\r\n\r\n	\r\n		\r\n\r\n		\r\n		      <div class="sectionHeaders js-hiddenFeatures" data-selenium="sectionHeaders">\r\n				    \r\n				            	\r\n				              <div class="js-featureSection"><h3 class="featureHeader c27 fs24">Dell Inspiron 15 7000 Series </h3>\r\n				              \r\n				            \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Quad-Core 6th-Gen Skylake Intel Core i7 Performance </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												The Dell Inspiron 15 houses a 6th-generation Skylake 2.6 GHz Intel Core i7-6700HQ Quad-Core processor. The processor can also be boosted up to 3.5 GHz, thanks to Intel Turbo Boost 2.0 technology. Additionally, it features 6MB of L3 cache as well as Hyper-Threading technology, which enhances the cores.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">NVIDIA GeForce GTX 960M Graphics </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												Built for an immersive gaming experience, the NVIDIA GeForce GTX 960M arms you with industry-leading technologies including dynamic PhysX effects, CUDA, and more. Based on NVIDIA\'s Maxwell GPU architecture, the NVIDIA GeForce GTX 960M provides optimal performance per watt.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Dual-Band 802.11ac Wi-Fi </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												Featuring dual-band 802.11ac Wi-Fi, the Dell Inspiron 15 delivers high performance, broader coverage, and longer battery life than previous Wi-Fi standards. The Dell Inspiron 15 also comes with Bluetooth technology so you\'ll be able to connect wirelessly to Bluetooth-compatible peripherals and accessories.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				            	</div>\r\n				              <div class="js-featureSection"><h3 class="featureHeader c27 fs24">Windows 10 Home </h3>\r\n				              \r\n				            \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Start Menu </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												After its hiatus in Windows 8, the Start Menu has returned. Utilizing a combination of the traditional menu system and Windows 8\'s Live Tiles, the improved Start Menu gives you more information at a glance, showing notification information alongside your applications and other pinned items.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Cortana </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												Microsoft\'s digital personal assistant, Cortana can answer your questions with information gleaned from both your device and the internet at large. You can type or even talk with her, if your system has a microphone. Using her Notebook, Cortana keeps track of your needs and wants, and she learns over time to improve her information gathering skills.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Microsoft Edge </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												After nearly 20 years, Microsoft has finally replaced its Internet Explorer web browser. With it, users can write directly on web pages and share notes with friends and colleagues. It also improves the online reading experience by adding a distraction-free mode and read-it-later functionality. Edge also has built-in Cortana integration; you can have her help you find a restaurant, make a reservation, and pull up directions without leaving your browser.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Windows Store </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												For Windows 10, Microsoft has unified the Windows Store. Now, apps for PCs, tablets, and phones will all be accessible from one place. And with support for Universal Apps, one version of an app can work across all your compatible devices automatically.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Windows Continuum </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												Windows 10 was designed for a variety of screen sizes and input styles, and with its Continuum feature, it automatically adapts to fit your needs. A Windows 10 tablet on its own requires a touch-centric approach, but attaching a mouse and keyboard will shift everything to a more traditional interface. You can even attach an external monitor to your Windows 10 phone for a near-desktop experience. But it\'s not just the operating system; Windows Universal Apps take advantage of Continuum as well.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				               <dl class="js-featureSectionDL">\r\n									\r\n										<dt class="featureTitle">Xbox on Windows 10 </dt>\r\n									\r\n								    \r\n										<dd class=\'c28\'>\r\n\r\n										\r\n												Gaming is a big focus of Windows 10. Xbox integration allows for PC players to match up against Xbox One players on supported games, and if you have an Xbox One, you can even stream compatible titles to your PC. Native support for recording with the new Game DVR feature makes it easy to capture and share your gameplay. The new DirectX12 takes better advantage of multi-core processors, giving games a performance boost, even on older hardware. Windows 10 also features native support for virtual reality headsets, such as the Oculus Rift.\r\n										  \r\n										 </dd>\r\n				                        \r\n				            		\r\n				               </dl>\r\n\r\n				         \r\n				    \r\n				    </div>\r\n		      </div>\r\n		  \r\n		\r\n	\r\n\r\n	\r\n\r\n	\r\n\r\n</div>\r\n\r\n\r\n\r\n\r\n	<div class="product-upc">\r\n		<img class="upcImg" width="14" height="15" title="" alt="" src="data:image/png;base64," />\r\n		<span class="upcNum">UPC: 884116217992</span>\r\n	</div>\r\n\r\n												\r\n											</div>\r\n											<div class="rightPanel">\r\n												\r\n												\r\n													<div class="whatsInTheBoxWrapper">\r\n														<div class="whatsInTheBox