(16639, 1539, 2, 'Forty Eight 10/100/1000 ports deliver non-blocking, full-speed packet forwarding with 48 Gbps bandwidth migrates your network to future-proof functionality. Two SFP GBIC fibre slots provide optional fibre connectivity for greater distance. Smart Switch capability enables key management features for the value price of an unmanaged switch. Included are performance monitoring, port configuration, VLAN for traffic control, port trunking for increased bandwidth, and Class of Service (CoS) for traffic prioritization.Ideal for growing businesses who want the benefits of management without the cost and complexity of a fully SNMP-capable network. Simple to set up and simple to use for effortless network monitoring and troubleshooting. Made to last, this sturdy switch is housed in a 17-inch metal box and comes with a rack mounting kit.'),
