(16650, 1537, 2, 'The NETGEAR Universal Dual Band WiFi Range Extender - Wall-plug Edition, simultaneously extends WiFi coverage of an existing WiFi network throughout your home so you can get better coverage for your WiFi devices - on your patio or even in the backyard. The WiFi Extender supports simultaneous dual band WiFi coverage so you can connect devices on both 2.4 GHz and 5 GHz bands. While providing better WiFi coverage, the WiFi Extender also allows you to play music wirelessly over your network through any stereo or speaker in your home. By plugging in a USB printer into the USB port on the WiFi Extender, you can make any wired USB printer accessible wirelessly from any WiFi device and any room in your home.'),
