(16804, 1553, 2, 'With a total power budget of 195 Watts, customers can choose to plug in up to 24 Ethernet or Fast Ethernet devices and mix in up to 24 802.3af IP-based devices.Power-over-Ethernet (PoE), optimizes the installation and power management of network devices such as wireless access points (AP), Voice over IP (VoIP) phones, and IP-based surveillance cameras.Power-over- Ethernet (IEEE 802.3af) capabilities reduce installation time and costs for many new network productivity devices.Free your wireless AP deployments and IP cameras from the restrictions of power outlet proximity using a standard Cat 5 cable.Enable uninterruptible power supply for all your PoE devices by powering your switch from a UPS device.'),
