(16815, 1554, 2, '8 switched 10/100 Mbps ports :- Each port provides dedicated 10 or 100 Mbps bandwidth for connecting one or multiple PCs, servers, and hubs. In full-duplex mode, each port supports up to 200 Mbps of throughput.Automatic speed and full/half-duplex sensing :- The switch supports n-way auto negotiation, and each port automatically senses and operates at the proper speed and duplex mode, taking the burden of configuration off the user. Vista jacks with built-in LEDs clearly indicate port status :- simplifying installation and troubleshooting. The switch is plug and play with no software to configure. Versatile and compatible :- The switch is protocol independent and is compatible with all popular networks such as the Internet or TCP/IP, NetWare, Microsoft Windows, or LANTASTIC. 24-hour phone support. NETGEAR\'s 24x7 support guarantees that if you ever have trouble with this or any product from NETGEAR there is always someone there to help you on the phone.'),
