(16826, 1555, 2, 'NETGEAR ProSafe Smart Switches fill the gap between unmanaged and fully managed switches. The family of ProSafe Smart Switches is designed for growing businesses that want control over their network without the cost and complexity of a full Layer 2/Layer 3 management implementation. This PoE capable Smart Switch, the FS728TP, provides power and data using built-in IEEE 802.3af PoE on all 24 ports. In addition, the FS728TP offers an intuitive web-based management tool for quick and easy deployment and configuration making it ideal for deploying access points, VoIP phones and IP-based surveillance cameras. This switch is equipped with highly advanced features such as Access Control Lists (ACL), 802.1x port authentication, enhanced QoS, rate limiting and IGMP Snooping among others to provide a small and medium-sized business with a network that is geared for growth while providing scalability and reliability. With the utility of 24 10/100 Mbps ports, two copper 10/100/1000 ports and two combination (Copper/hot-swappable Small Form-factor Pluggable (SFP) Gigabit ports for optional fibre connectivity, growing business networks, classrooms and workgroups can benefit from superior performance and keep up with expanding network needs. This high performing switch features a no blocking wire-speed architecture with a 12.8Gbps switching capacity for maximum data throughput. All 28 RJ-45 ports automatically negotiate to the highest speed and support Auto Uplink technology to make the right link.'),
