(16947, 1568, 2, 'Moves huge files fast! Features 16 high-speed, auto-switching 10/100/1000 Mbps Ethernet connections. And because Copper Gigabit Ethernet is a full duplex standard, you can get up to 2000 Mbps on each port.Integrates 10, 100, and 1000 Mbps devices on the same network and will honor Layer 2 802.1p traffic priority tags. Every port automatically senses the right speed and full/half duplex mode, while Auto UplinkTM technology automatically adjusts for straight-through or crossover cables.LEDs embedded in each of the 16 RJ-45 jacks make for easy monitoring. Space-saving dimensions are ideal for desktop or wall mounting in home, small office, workgroups, departments and conference room environments. Its durable metal case has no fan for silent operation. Compatible with either PC, Macintosh, Unix, or Linux operating systems.Providing plug-&-play simplicity with exceptional performance and reliability, the GS116 is a cost effective solution for your growing network. This switch is made to last and NETGEAR backs it with a solid warranty: switch - 5 years, power supply - 2 years.'),
