(16958, 1567, 2, 'You now have the choice to go green when upgrading to a gigabit network! This new generation TL-SG1005D 5-Port Gigabit Desktop Switch features the latest innovative energy-efficient technologies that can greatly expand your network capacity with much less power. It automatically adjusts power consumption according to the link status and cable length to limit the carbon footprint of your network. Power down Idle Ports - When a computer or network equipment is off, the corresponding port of a traditional switch will continue to consume considerable amounts of power. The TL-SG1005D can automatically detect the link status of each port and reduce the power consumption of ports that are idle, resulting in up to an 80% reduction in power use. Power Budget According to Cable Length - Ideally, shorter cable would use less power because of less power degradation over their length; this is not the case with most devices as they will use the same amount of power across the cable regardless of the length.'),
