(16980, 1574, 2, 'The TL-WA750RE\'s single Ethernet port allows the Extender to function as a wireless adapter to connect wired devices like Blu-ray players, gaming consoles, DVRs and Internet TVs. At the same time, the device can share the wireless network as well. 5 signal lights represent the current signal strength that TL-WA750RE receives from existing router, which can help to find the right location to place the range extender so that the TL-WA750RE can achieve the best possible range and performance of the network. Works seamlessly with all 802.11 b/g/n wireless devices. It is also compatible with the latest Windows 8 operating system.'),
