(17005, 1572, 2, 'You now have the choice to go green when upgrading to a gigabit network! This new generation of TL-SG1024DE 24-Port Gigabit Easy Smart Switch features the latest energy-efficient technologies that can greatly expand your network\'s capacity with much less power. It automatically adjusts power consumption according to the link status and cable length to limit the carbon footprint of your network. When a computer or network equipment is off, the corresponding port of a traditional switch will continue to consume considerable amounts of power. The TL-SG1024DE can automatically detect the link status of each port and reduce the power consumption of ports that are idle. Ideally, shorter cables would use less power with less power degradation over their length; this is not the case with most devices as they will use the same amount of power across the cable regardless of whether it is 10 or 50 meters in length. The TL-SG1024DE analyzes the length of the Ethernet cable connected and adjusts the power usage accordingly, rather than keeping the power consumption in a conventional solution. TL-SG1024DE is easy to use and manage. Auto MDI/MDI-X crossover on all ports eliminates the need for crossover cables or uplink ports. Auto-negotiation on each port senses the link speed of a network device (either 10, 100, or 1000 Mbps) and intelligently adjusts for compatibility and optimal performance. Its compact size makes it ideal for desktops with limited space while also being rack-mountable, convenient and safe. Dynamic LED lights provide real-time work status display and basic fault diagnosis.'),
