(17178, 1590, 2, 'When a computer or network equipment is off, the corresponding port of a traditional switch will continue to consume considerable amounts of power. The TL-SG1016D can automatically detect the link status of each port and reduce the power consumption of ports that are idle. Ideally, shorter cables would use less power because of less power degradation over their length; this is not the case with most devices as they will use the same amount of power across the cable regardless of whether it is 10 or 50 meters in length. The TL-SG1016D analyses the length of the Ethernet cable connected and adjusts the power usage accordingly, rather than keeping the power consumption in a conventional solution. The auto features of this gigabit switch make installation plug and play and hassle-free. No configuring is required. Auto MDI/MDIX eliminates the need for crossover cables. Auto-negotiation on each port senses the link speed of a network device (10, 100, or 1000 Mbps) and intelligently adjusts for compatibility and optimal performance.'),
