(17371, 1605, 2, 'Today\'s growing businesses are both placing more demands on and relying more on their network. Companies are putting more applications and demands on their Ethernet infrastructure. Using VoIP phones and IP cameras requires more than simple plug-and-play connectivity. Additionally, Internet-based applications such as Hotmail and Google Calendaring have made keeping the network up a business-critical need. However, companies do not necessarily have more money or advanced training to deal with complex managed switches. The new NETGEAR ProSafe Plus Switches meet this growing need by providing easy-to-use visibility and limited configuration capabilities. To provide more insight into the network behaviour, ProSafe Plus Switches offer traffic monitoring for users to observe traffic behaviour. Additionally, if there are connectivity issues, these switches offer a cable diagnostic test capability that can identify and even locate problems in the cables. To optimise traffic through the switches, ProSafe Plus Switches offer both port and tag-based prioritisation to keep latency-sensitive traffic moving ahead of less critical packets. Also, as a means of improving security or managing collision domains, ProSafe Smart Switches offer VLAN technology. ProSafe Plus Switches offer these monitoring and configuration capabilities at a slight cost premium over unmanaged switches, delivering great value to the end-user.'),
(17372, 1605, 5, '606449096446'),
(17373, 1606, 1, 'Save 52% on Netgear GS108T ProSafe 8 Port Gigabit Smart Switch'),
(17374, 1606, 34, ''),
(17375, 1606, 7, '119.99'),
(17376, 1606, 8, '57'),
(17377, 1606, 3, 'GS108T-200UKS'),
(17378, 1606, 10, '-52%'),
(17379, 1606, 12, '35 in Stock'),
(17380, 1606, 2, 'Joining NETGEARs family of Gigabit Smart Switches with web-based management, this 8-port Gigabit switch is high on value and capability. With 8 10/100/1000 Mbps ports and support for Jumbo frames, capable of powering 2000 Mbps of data throughput in full-duplex mode, it is ideal for small offices or extensions and connects high speed servers or power users. Ideal for combining 10, 100, and 1000 Mbps devices it delivers automatic speed and full/half-duplex sensing plus Auto Uplink on every port. In addition, an intuitive web-browser interface offers the simple Smart Switch management, making it easy to configure ports and set up port trunks, VLANs and traffic prioritization or monitor switch performance. Alternatively, use SNMP-based software to manage your Smart Switch. The GS108T is equipped with highly advanced features such as Access Control Lists (ACL), 802.1x port authentication, enhanced QoS, rate limiting and IGMP Snooping among others to provide a small and medium-sized business with a network that is geared for growth while providing scalability and reliability.'),
