(19503, 1701, 2, 'The HP 6600-24XG switch is a data center optimized, advanced Layer 3 1U stackable with 24 SFP+ 10 GbE ports and support for front-to-back reversible airflow, redundant hot-swappable power supplies, and redundant hot-swapple fans.INSERT INTO `urls_data_denormal` (`id`, `url_id`, `selector`, `value`) VALUES
