(20265, 1738, 2, 'Now you can have a powerful, high-speed network on a small scale. NETGEAR\'s GS116 Gigabit Ethernet Switch lets you build a system that provides a full, dedicated 1000 Mbps connections so you can move very large files across your network instantly. The standards-based GS116 helps to protect your existing and future network infrastructure investments by painlessly integrating other 10,100, and 1000 Mbps devices. This potent switch is ideal for workgroups or quickly upgrading workstations to full Gigabit speed, plus it\'s packed with ease-of-use features to simplify your workday experience. Its compact design fits neatly into small work spaces and, since it\'s self-cooling without a fan, it runs silently and unobtrusively.'),
