(21141, 1790, 2, 'Enjoy lag-free gaming with the ultimate in AC speed & performance. Nighthawk delivers AC1900 WiFi, a powerful dual core 1GHz processor, & advanced upstream QoS for optimized game play on consoles like the XBox. When microseconds count, let Nighthawk accelerate your game. For the win.  Stop buffering and start enjoying uninterrupted streaming media with features like downstream QoS, Beamforming+ and built-in iTunes server you\'ll begin to stream like you mean it. Access your stored media quickly with USB 3.0 and keep it safe with free automatic backup software for PCs & Time Machine compatible for Macs.  Improve your mobile WiFi speeds by up to 100% with Nighthawk! High-powered amplifiers & antennas help extend WiFi coverage throughout large homes & even backyards. Beamforming+ focuses WiFi signals to WiFi devices. With signals locked onto your device, experience what it really means to be mobile!'),
