(23650, 1932, 2, 'NETGEAR\'s popular FS100 series desktop switches, known for their reliability and performance, provide your LAN with high-speed, 10/100Mbps auto-sensing connectivity for as many as 8 users. Just plug in your Ethernet cables, connect a power cord, and youre ready to go-theres no software to configure. They negotiate to the fastest possible connection and with Auto Uplink technology, these switches automatically figure out if the link needs a straight-through or cross-over connection, and makes the right choice. Existing 10BASE-T devices are easily integrated within higher bandwidth environments, with full wire speeds on all ports of either 10Mbps or 100Mbps. Engineered without the need for internal fans, they operate silently. And each of these very compact switches is housed in a sturdy metal case for years of dependable use.Eight ports provide LAN access for many users. Every port supports up to 200Mbps in dedicated bandwidth and traffic is forwarded flawlessly with automatic flow control.Solidly built in small sizes that are easy to position when space is at a premium. Ideal for conference rooms, class rooms, study groups or small offices. Place it on any flat surface or use the included wall mount kit to tuck it out of the way.Once you connect the hardware, your switch is operating! Auto negotiation takes care of the speed and duplex, while Auto Uplink takes care of the MDI/MDI-X connection. Eliminate the need for toggle switches or special crossover cables.No fan means no noise, which helps maintain a peaceful atmosphere in your busy office.Physical Specifications:FS108- Dimensions: 6.2 x 4.1 x 1.1 in(158 x 103 x 27 mm)- Weight: 1.1 lbs (0.49 kg)'),
