(24586, 1976, 2, 'Increasingly, businesses are at the mercy of data availability and are exposed to severe data loss and prolonged downtime in the event of a disaster. As storage demand continues to grow, proper backup of that storage to an offsite location becomes a challenge, especially for small businesses and remote offices that may not have a dedicated IT staff. Setting up online backup can be daunting and the task can often be procrastinated and forgotten. Thats where ReadyNAS Replicate comes in.Your business already entrusts your most important data to the ReadyNAS. ReadyNAS Replicate simplifies the replication of that data to another ReadyNAS whether the two systems are on the same LAN or whether theyre a world apart. Simply set up the replication job and run the initial replication locally. Then move the second ReadyNAS anywhere with Internet access, and the replication continues, with no additional setup. As you can see, ReadyNAS Replicate is just one of many smart ways that the ReadyNAS simplifies your business storage needs.'),
