(25258, 2005, 2, 'Application data, virtual images, client files, email the types of data central to running a successful business can seem endless. With ReadyNAS you finally have an advanced and easy-to use solution for centralizing, securing and controlling access to your digital assets.  Way more than just simple unified (NAS and SAN) storage for your company, ReadyNAS allows you to do more than you ever thought you could afford by pairing the latest in performance with innovative efficiency technologies such as unlimited snapshots, thin provisioning and cloud-managed replication.Every networked attached storage (NAS) device from NETGEAR runs on the revolutionary ReadyNAS 6.0 operating system. This custom-built OS protects stored data not only with automatic RAID configuration, but is the first of its kind to feature the continuous data protection of unlimited snapshots along with real-time anti-virus and native encryption. Designed with ease-of-use in mind, ReadyNAS devices utilize proprietary ReadyCLOUD technology for cloud-based discovery, provisioning and even ongoing management.These days, your data is your world. With ReadyNAS, protecting and accessing that world has never been easier.  ReadyNAS 6.0 - Storage Made EASY.'),
