(25282, 2007, 2, 'The TL-WR841ND Wireless N Router is a combined wired/wireless network connection device designed specifically for small business, office, and home office networking requirements. It complies with the IEEE 802.11n (Draft 2.0)standard with wireless transmission speeds of up to 300M. The router adopts 2 2 MIMO technology and has two external antennas providing even better wireless performance, transmission rates, stability and coverage. At the same time, CCA technology automatically avoids channel conflicts using its channel selection feature. It also works well with other 11g and 11n protocol wireless products.The TL-WR841ND provides multiple security measures; supporting SSID broadcast control, MAC address access control, WEP encryption, WPA/WPA2, and WPA-PSK/WPA2-PSK authentication. At the same time QSS( Quick Secure Setup) complies with WPS allowing for worry-free wireless security configuration. These combined security features will guard against intruders using stronger, safer protection.The TL-WR841ND allows companies, offices, and homes to share one Internet connection with more computers. Apart from this product is simple setup and more common broadband router functions, it also supports priority of service where applications using a lot of bandwidth that are sensitive to interruptions such as voice and video are given priority in order to assure quality This is a fashionable product with superior performance and should be your first choice when setting up a network.'),
