(29605, 1512, 2, 'This function support allows your servers to directly connect to the switch for fast, reliable data transfer. At 2000Mbps full duplex, the switch provides high-speed data pipes to your servers with minimum data transfer loss. All ports support auto-negotiation of MDI/MDIX cross over. This eliminates the need for cross over cables or uplink ports. Any port can simply plug to a server, a hub or a switch, using the usual straight-through twisted-pair cable. The switch integrates seamlessly with your existing network equipment, be it Ethernet, Fast Ethernet or Gigabit Ethernet, dispensing you of the need to replace any hardware or software. With 10/100/1000Mbps auto-sensing, auto-negotiation for every port, plus the ability to exist with your Cat. 5 wall wiring, network installation is a breeze. All you need to do is plug the cables to the switch, and your network is up and running in a matter of minutes.'),
