(32110, 2323, 1, 'TP-Link 5-Port Unmanaged Gigabit Desktop Switch TL-SG1005D B&H'),
(32111, 2323, 2, 'The 5-Port Unmanaged Gigabit Desktop Switch from TP-Link is a networking tool that\'s affordable and easy to use. This switch features five speedy Gigabit Ethernet ports for connecting computers or other Ethernet-enabled devices on your LAN network. In addition, this switch supports flow control, 15K jumbo frames, MAC address auto-learning and auto-aging, as well as Auto MDI/MDIX on all ports. It is packaged with material that is 80% recyclable and also features built-in energy-efficient technology so as to reduce power consumption when possible.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												The built-in energy-efficient technology saves power of up to Up to 75% when compared to conventional TP-Link switches\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Supports IEEE 802.3x flow control for Full Duplex mode and backpressure for Half Duplex mode\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Non-blocking switching architecture that forwards and filters packets at full wire-speed for maximum throughput\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Switching capacity of 10Gbps\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												15k Jumbo frame improves performance of large data transfers\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				          '),
