(32132, 2321, 1, 'Netgear M7100 Series 24-Port ProSafe 10 Gigabit XSM7224-100NES'),
(32133, 2323, 22, '(0)'),
(32134, 2321, 2, 'The M7100 Series 24-Port ProSafe 10 Gigabit Managed Switch from Netgear is a fully managed switch for the 1G/10G server access layer in campus and enterprise networks, and for high-density 10GbE backbone architectures. It delivers line-rate performance for top-of-rack virtualization or convergence, without having to pay the exorbitant acquisition and maintenance costs associated by other networking vendors. Netgear 10 Gigabit Aggregation solutions combine latest advances in hardware and software engineering for higher availability, lower latency and stronger security, at a high-value price point. Like all Netgear products, the M7100 series delivers more functionality with less difficulty: Auto-iSCSI optimization, Private VLANs and Local Proxy ARP take the complexity out of delivering network services for virtualized servers and 10 Gigabit infrastructures.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Layer 2+ with Static Routing \n									\n								    \n										\n\n										\n												The switch series comes with Port/VLAN/Subnet based static routing Layer 2+ versions \nL3 fixed routes to the next hop towards the destination network are added to the routing table \nL3 routing is wire-speed in the M7100 series hardware with up to 128 static routes (IPv4)\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										10 Gigabit Transition with Base-T \n									\n								    \n										\n\n										\n												10GBase-T, like other Base-T technologies, uses the standard RJ45 Ethernet jack \nIt is backwards compatible, auto-negotiating between higher and lower speeds thereby not forcing an all at once network equipment upgrade \nCat5/Cat5E are supported for Gigabit speeds when Cat6 twisted pair copper cabling is a minimum requirement for 10 Gigabit up to 30 meters \nCat6A or newer Cat7 cabling allow for up to 100 meter 10GBase-T connections\n		'),
