(32165, 2324, 2, 'The 2TB TeraStation Pro Duo Network Attached Storage from Buffalo is a network hard drive array with a dual-core Intel Atom CPU, 2GB of RAM, and dual Gigabit Ethernet ports. The dual-port design supports port trunking, which uses both ports to transfer data simultaneously, increasing the array\'s real-world throughput speed. The array is compatible with Windows client operating systems.The array features two drive bays, each of which is populated in this configuration with a 1TB SATA 3Gbps hard drive. Together, the drives can be configured as a RAID 0, 1, or JBOD. RAID 0 delivers maximum data transfer performance without protection. RAID 1 creates of a copy of any data that you save, so you have added protection. JBOD treats each of the individual disks as a single volume without offering any form of data protection.The array supports numerous enhanced network storage features. Its BitTorrent client allows you to download files from the Internet directly to the array, even if your computer is powered down. An FTP server allows you to upload files to the array via an FTP client. USB 3.0 and USB 2.0 expansion ports allow you to connect external hard drives, printers, and other devices for network access.Network backup is supported via the ten included licenses for the NovaBACKUP Business Essentials software package. This allows you to perform network backup of up to ten Windows PCs, servers, Exchange databases, or SQL databases. Built-in support for DLNA/UPnP media streaming makes it possible to view media files stored on the array on DLNA certified media players.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												The TeraStation Pro Duo utilizes an Intel Atom 1.66GHz Dual Core Processor and 2GB of onboard RAM to provide exceptional performance during file transfers and everyday NAS functions. TeraStation Pro Duo runs many services simultaneously and these pieces of hardware enable it to focus on c'),
