(32179, 2325, 1, 'LenovoEMC px4-300r 4-Bay Network Storage (4TB) 70BJ9006WW B&H'),
(32180, 2325, 2, 'The 4TB px4-300r 4-Bay Network Storage from LenovoEMC is a high-performance Server Class rackmount array that is powered by the LenovoEMC storage technology. It has a maximum storage capacity of up to 16TB. It comes in a space-saving 1U form factor that is suitable for use in small- to medium-sized businesses and distributed enterprises for advanced data protection and local and remote content sharing.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Supports up to 150 users.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Intel Celeron Dual Core CPU, 2 GbE NICs\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Maximum storage capacity of up 16TB with the presence of 4 SATA HDD bays. Empty bays are fitted with a drive carrier. The carrier can accommodate 2.5" and 3.5" drives.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Server Class Hard Drives ensure higher reliability and performance. These drives are designed to better handle rotational vibration and continuous operation for mission critical applications.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Snapshots allow point-in-time backup of a complete volume image including Active Snap capability. Also uses .VSS and .VDS for compatibility with Windows & VMware hosts.\n										  \n										 \n				                        \n				            		\n				               \n\n		'),
