(32202, 2322, 1, 'TP-Link TL-WR941ND Wireless-N300 Router TL-WR941ND B&H Photo'),
(32203, 2322, 2, 'The TL-WR941ND 300 Mbps Wireless-N Router from TP-Link is a combined wired/wireless network connection device designed specifically to meet the small business, office and home networking requirements. It provides a simple and fast way to access the Internet for work or fun. It complies with the IEEE 802.11n (Draft 2.0) standard with wireless transmission speeds of up to 300 Mbps. The router features four 10/100Mbps switch ports to achieve the most effective data transmission. The TL-WR941ND adopts MIMO technology as well as SST technologies. It also has three external detachable omni directional antennas providing stability and coverage. The TL-WR941ND also provides easy and quick security setup with WPS (Wi-Fi Protected Setup), which allows you to secure your network at the push of a button.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Long Range Signal \n									\n								    \n										\n\n										\n												Equipped with 3 antennas and 3x3 MIMO technology, users can create a high speed wireless network with up to 18x the speed and 6x the range of conventional 11g products. It can also mitigate data loss over long distances and through obstacles in a small office or a large apartment, even in a steel-and-concrete building. Above all, you can easily pick up a wireless network over a long-distance connection where legacy 11g products cannot\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Wireless-N Technology \n									\n								    \n										\n\n										\n												The router has the speed to work smoothly with almost any bandwidth intensive application including VoIP, HD streaming, or online gaming, without any time lag. Using its powerful N technologies, the router is also able to mitigate data loss over long distances and and that caused by obstacles, turning your home and even your yard into one big hotspot\n				'),
