(32225, 2331, 1, 'D-Link DGS-108 8-Port Gigabit Ethernet Switch DGS-108 B&H Photo'),
(32226, 2331, 2, 'The DGS-108 8-Port Gigabit Ethernet Switch from D-Link provides eight speedy Gigabit Ethernet auto-sensing ports for connecting multiple computer devices to your network. Once you\'ve connected the switch to your network via one Gigabit Ethernet port, you will have seven other ports for connecting printers, scanners, storage, backup devices, and more. Support for Quality of Service (QoS) means the switch will prioritize network traffic that is sensitive to lags, such as video streaming or VoIP calls. \nThe switch is unmanaged and plug-and-play, so you need not install software first to use it or configure settings for it later. Plus, the diagnostic LEDs on the front panel let you know if there are any connection issues, helping you troubleshoot problems as they arise.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Built-in D-Link Green Technology\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Rugged metal housing\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Inexpensive Gigabit solution for small and medium business\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												A total of eight Gigabit Ethernet ports\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												16Gbps switching fabric\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n						'),
