(32248, 2333, 1, 'TP-Link  150Mbps Wireless Lite N Router TL-WR740N B&H Photo Video'),
(32249, 2333, 2, 'The TP-Link TL-WR740N 150Mbps Wireless Lite N Router is a combination wired and wireless network connection with a 4-port switch that allows internet access to multiple devices in your home without running unsightly wires.This router is 802.11b & g compatible via 802.11n, which offers an impressive 150Mbps at a very reasonable price. Besides high speed, 802.11n gives you great performance even at long distances, as well as an SPI firewall to prevent your network from being compromised. The TL-WR740N is backward compatible with 802.11b and g and thanks to Align technology from Atheros Communications, Inc is forward compatible higher-performance, multi-stream, MIMO-based 802.11n.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Easy to Use \n									\n								    \n										\n\n										\n												The router comes with a CD with an Easy Setup Assistant that helps you step by step to complete your Internet connection, wireless network settings and security configurations. This feature allows even novice users to setup the router products without sacrificing any key features, just play the AUTO-RUN CD bundled to have your network set up quickly & hassle-free.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Quick Secure Setup \n									\n								    \n										\n\n										\n												QSS for Quick Security Setup is a handy feature that allows users to almost instantly setup their security simply by pressing the QSS button on the wireless router or entering the PIN Code in the net card, it automatically establishes a WPA2 secure connection, instantly protecting your network.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Works with 11N Devices \n									\n								    \n										\n\n										\n												When working with IE'),
