(32316, 2335, 1, 'Netgear ProSafe GBIC Module 1000Base-SX SFP AGM731F B&H Photo'),
(32317, 2332, 16, ''),
(32318, 2335, 2, 'The ProSafe GBIC Module 1000Base-SX SFP from Netgear is an expansion module that adds high-density fiber connectivity to compatible Netgear devices. It installs in a SFP GBIC compliant slot and features an LC connector that is compatible with both 50um and 62.5um multimode fiber cables.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Fiber Connectivity via LC \n									\n								    \n										\n\n										\n												The module features an LC connector for fiber connectivity. Fiber allows you to transmit data at Gigabit speeds over much longer distances than standard copper cabling. This module is compatible with both 50um and 62.5um multimode fiber cables.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										SFP GBIC Compliant \n									\n								    \n										\n\n										\n												The module is compatible with devices that feature an SFP GBIC expansion port. This allows you to add it to the following switches by Netgear: GSM7328S, GSM7352S, GSM7324, GSM7312, GSM7248, GSM7212, FSM7352S, FSM7328S, FSM7326P, GS748T, GS724T, GS716T, FS750T2, FS726TP, FS726T and JGS524F.'),
