(32340, 2336, 1, 'TP-Link ARCHER T4U Wireless-AC1200 Wireless Dual Band ARCHER T4U'),
(32341, 2336, 2, 'Using its USB 3.0 port, connect your Windows-compatible desktop or notebook computer to dual band 802.11ac wireless networks, as well as 802.11a/b/g/n networks with the ARCHER T4U Wireless-AC1200 Wireless Dual Band USB 3.0 Adapter from TP-LINK. Dual band support allows you to connect to networks supporting 5 GHz and 2.4 GHz frequencies. 5 GHz frequencies allow compatible devices to take advantage of data transfer speeds of up to 867 Mbps for HD video streaming and online gaming. The 2.4 GHz frequency provides data transfer speeds of up to 300 Mbps and allows users to engage in less-intensive web tasks, such as web browsing.\n\nFor those who are concerned about a USB Wi-Fi adapter not having a strong range, the AC1200\'s omni directional antenna will help to increase the strength and range of your wireless signal. Additionally, the integrated wireless security supports 64- and 128-bit WEP, WPA-PSK/WPA2-PSK, and 802.1x encryption standards, as well as ad-hoc and infrastructure modes. For simpler network encryption setup, the router includes a WPS button and a wireless setup utility helps to simplify initial network setup. The AC1200 is also backwards compatible with USB 2.0 and includes a resource disc, a quick installation guide, and a USB extension cable.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										802.11ac Wi-Fi \n									\n								    \n										\n\n										\n												TP-LINK\'s Archer T4U comes with the Wi-Fi standard 802.11ac, which is up to three times faster than wireless N speeds. With wireless speeds up to 867 Mbps over the 5 GHz band or 300 Mbps over the 2.4 GHz band, the Archer T4U is designed for HD streaming, online gaming, and tasks that require high bandwidth\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										AC1200 Wireless Speed \n									\n								    \n										\n\n										\n												The 5 GHz 867 Mbps ban'),
