(32913, 2365, 1, 'D-Link DIR-600L Wireless N 150 Home Cloud Router DIR-600L B&H'),
(32914, 2365, 2, 'The D-Link Wireless N 150 Home Cloud Router provides a safe and secure network environment. It enables access to the Internet cloud via the mydlink service for remote network monitoring. This capability is yours with free downloadable iPad, iPhone and smartphone apps available on Apple\'s App Store and the Android Market (iPad users must download the mydlink Lite app). Such features permit you to keep tabs on website visits and intrusion attempts from any location. The router delivers advanced performance using wireless 802.11n technology, with greater speed and range than legacy 802.11g, allowing for data transfer rates of up to 150 Mbps.Enjoy complete compatibility: The router will work with all Wi-Fi certified devices, ensuring reliable performance no matter what type of electronics you\'re using. It\'s got a full security detail at its back, too, including an SPI (Stateful Packet Inspection) and NAT (Network Address Translation) firewall--which also analyzes network traffic--and WEP, WPA and WPA2 wireless encryption to safeguard your network against threats from hackers and would-be identity thieves. The cloud service detects and blocks unwelcome attempts to access your network, and shows a suspicious activity report right on your app or web browser. NAT permits multiple users to connect to the web by sharing one IP address.You\'ll love how easy the device is to set up, too. The Easy Setup Wizard and Wi-Fi Protected Setup (WPS) enable simple, no-sweat configuration and addition of new devices. Set up your wireless network in a matter of minutes. The wizard guides you through each step, from installing hardware to connecting your network and adding devices. It also configures your ISP (Internet Service Provider) settings in order to rapidly establish broadband web connectivity. Plus, to help ensure that your router remains up-to-date with the latest and greatest features, the mydlink cloud service notifies you when updates are available.Connect your Cloud Router to a'),
