(32395, 2338, 2, 'The 24-Port Gigabit Smart PoE Switch with 4 Combo SFP Slots from TP-Link is designed for small and medium business networks that require high connectivity, functionality, and performance. This switch can be configured to meet multiple needs and provides you with 24 Gigabit Ethernet ports that support network traffic at speeds up to 1000 Mbps. Also supported is 802.3at/af-compliant Power over Ethernet (PoE) up to 180W. PoE passes electrical power along with data on Ethernet cabling, allowing a single cable to provide a data connection and electrical power to devices such as wireless access points or IP cameras.\n\nThis 24-Port Switch includes 4 combo SFP (small form-factor pluggable) slots. This expands the flexibility of your network, as these slots support SONET, Gigabit Ethernet, Fibre Channel, and other communications standards. It also features a 48 Gbps bandwidth and a 37.5 Mbps forwarding rate, which allow for fast data transfers, and an 8K MAC Address Table, which allows you to store a large number of MAC addresses.\n\nAlso provided are security features, such as Storm Control, which protects against Broadcast, Multicast, and Unknown-unicast Storm. Network traffic is managed with Quality of Service (L2 to L4) to help ensure a smooth and even network flow. Setup is simplified with user-friendly web management interfaces, including CLI, SNMP, and RMON.\n\nThis TP-Link switch operates at 100-240 VAC at 50/60 Hz and includes a power cord, resource CD, rackmount kit, and rubber feet.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										IEEE 802.3at/af-compliant Power over Ethernet \n									\n								    \n										\n\n										\n												The TL-SG2424P supports 24 ports of IEEE 802.3at/af-compliant PoE and has a total power supply of 180W to power any 802.3at or 802.3af compliant power device. It\'s an efficient and cost-effective choice to work with wireless access points, surveillance cameras, IP phones, and other PoE supported devices,'),
