(32409, 2337, 1, 'TP-Link Archer C5 AC1200 Wireless Dual Band Gigabit ARCHER C5'),
(32410, 2337, 2, 'The Archer C5 AC1200 Wireless Dual Band Gigabit Router features 802.11ac wireless speeds that is three times faster than wireless 802.11n. It combines the 2.4 GHz and 5 GHz bands to provide a wireless data transfer rate of up to 1200 Mbps. These features help you watch HD videos and play fast-paced games without any lag. Built with two antennas, the router uses the external antennas to support the 5 GHz band for intensive tasks while the 2.4 GHz band is designed for simple tasks such as web browsing and emailing.  The Archer C5 router connects to your Internet modem using the single WAN port and offers four Gigabit Ethernet jacks that provide access to the Internet for computers having only a wired RJ-45 port. In addition, it comes with two USB 2.0 Ports so you can share your printer or USB storage device. For convenience, the TP-LINK Tether app provides access to the router using your iOS and Android devices. It also lets you set up the router, configure parental controls, share media as well as checking the status of the router and settings. Included with the router are two detachable antennas, a power supply, resource CD, and an Ethernet cable.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Supports 802.11ac Dual band - for combined wireless speeds of up to 1200 Mbps at 2.4 GHz and 5 GHz band concurrently Full gigabit ports provides fast data transfer speeds to wired systems Easy network management at your fingertips with TP-LINK Tether USB Connectivity - easily share a printer locally and files and media with networked devices or remotely via FTP server Guest Network Access provides secure Wi-Fi access for guests sharing your home or office network Two external antennas provide faster connection speeds as well as greater wireless coverage and reliability IPv6 supported IP-based Bandwidth Control makes it easier for you to manage the bandwidth of devices connected to the router Wi-Fi On/O'),
