(32432, 2340, 1, 'TP-Link 150 Mbps High Gain Wireless USB Adapter TL-WN722N B&H'),
(32433, 2340, 2, 'The TP-Link 150 Mbps High Gain Wireless USB Adapter allows you to connect a desktop or notebook computer to a wireless network and access a high-speed Internet connection. Compliant with IEEE 802.11n, it provides wireless speeds up to 150 Mbps, which is great for online gaming or video streaming. Using Align TM 1-stream technology based on 802.11n technology, the adapter gives you a more robust wireless signal than existing wireless 802.11g technology can provide. The adapter demonstrates an excellent ability to curb data loss over long distances and through obstacles in a small office or a large apartment--even in a steel-and-concrete building! You can easily pick up the wireless network during long-distance connection, where legacy 11g wireless products may not be able to do so.Clear Channel Assessment (CCA) technology automatically avoids channel conflicts using its clear channel selection feature, and fully realizes the advantages of channel binding, greatly enhancing wireless performance. As for security, the adapter provides WPA/WPA2 encryptions that are created by the WI-FI Alliance industry group, promoting interpretability and security for WLAN, more effectively and efficiently protecting the wireless network than a WEP encryption.The adapter\'s 4 dBi high gain external antenna can be rotated and adjusted in different directions to fit various operation environments, and can bring better performance than the internal antenna. For even more demanding applications, the antenna can be replaced with diverse antennas to show even greater flexibility and wider wireless coverage.Compatible with WI-FI Protected Setup (WPS), this adapter features Quick Security Setup that allows you to almost instantly setup your security. Just press the "QSS" button and you will automatically establish a WPA2 secure connection. This is not only faster than normal security setups, but also more convenient in that you don\'t need to remember a password. An included CD with utility help'),
