(32455, 2327, 1, 'TP-Link Archer D7 AC1750 Wireless Dual Band Gigabit ARCHER D7'),
(32456, 2327, 2, 'The TP-link Archer D7 AC1750 Wireless Dual Band Gigabit ADSL2+ Modem Router is built with an ADSL modem and router as well as RJ-45 ports and three dual band external antennas that allow you to create a wired and wireless network. It provides ADSL and LAN/WAN ports that offer greater choices when choosing an Internet service provider by allowing you to connect via ADSL, cable, or fiber modem. Featuring 802.11ac speeds, you can watch HD videos and play fast-paced games without any lag when connected wirelessly to the router. In addition, it also supports 802.11a/b/g/n so you can connect all your other Wi-Fi enabled devices to the network. Equipped with antennas and amplifiers, you can experience wireless performance in every direction with better coverage in your home or office. \nThe router combines 2.4 GHz and 5 GHz bands to provide a wireless data transfer rate up to 1750 Mbps. By offering dual bands, it can better handle multiple users accessing the network. The 5 GHz band provides a wireless speed up to 1300 Mbps for intensive tasks, while the 2.4 GHz band offers a speed up to 450 Mbps for simpler tasks such as web browsing and emailing. When a computer has only a wired RJ-45 port, the Archer D7 router offers four (three when connected to a fiber or cable modem) Gigabit LAN Ethernet ports for providing access to the network. Furthermore, it comes with two USB 2.0 ports so that you can share your printer or USB storage device. For security, this router supports various encryptions and lets you create a guest network to protect your Wi-Fi access code and other personal data. Included with the router are a telephone cable, Ethernet cable, external splitter, power adapter, and a resource CD to help you configure the network settings in just a few minutes.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Wireless and Wired Performance \n									\n								    \n										\n\n										\n												Supports 802.11ac and is compatible with'),
