(32479, 2326, 2, 'With the TL-WA750RE 150 Mbps Universal Wi-Fi Range Extender from TP-Link you can quickly and easily extend the range of your current wireless network. Along with extending your wireless network, the TL-WA750RE150 works simultaneously as an Ethernet bridge providing a wired connection to devices such as smart TVs, game consoles, PCs and more. \n\n\nWith one Fast Ethernet port you can connect a wide variety of Ethernet enabled devices directly to the range extender. You can also connect Wi-Fi enabled devices to the range extender as it supports IEEE 802.11b/g/n connections on the 2.4-2.4835 GHz frequency. Additionally, when connecting wirelessly to the range extender you benefit from enhanced 64/128/152-bit WEP, WPA-PSK, and WPA2-PSK wireless encryption standards.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Range Extender mode boosts wireless signal to previously unreachable or hard-to-wire areas flawlessly\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Miniature size and wall-mounted design make it easy to deploy and move flexibly\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Easily expand wireless coverage at a push of the Range Extender button\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												The Smart Signal Indicator Light helps you to find the right location to place the range extender\n										  \n										 \n				                        \n				            		\n				  