(32938, 2363, 1, 'TP-Link AC600 Wireless Dual Band USB 2.0 Adapter ARCHER T2U B&H'),
(32939, 2363, 2, 'Using its USB 2.0 port, connect your Windows-compatible desktop or notebook computer to dual band 802.11ac wireless networks, as well as 802.11a/b/g/n networks with the AC600 Wireless Dual Band USB 2.0 Adapter from TP-LINK. Dual band support allows you to connect to networks supporting 5 GHz and 2.4 GHz frequencies. 5 GHz frequencies allow compatible devices to take advantage of data transfer speeds of up to 433 Mbps for HD video streaming and online gaming. The 2.4 GHz frequency provides data transfer speeds of up to 150 Mbps and allows users to engage in less-intensive web tasks, such as web browsing.\n\nFor those who are concerned about a USB Wi-Fi adapter not having a strong range, the AC600\'s omni directional antenna will help to increase the strength and range of your wireless signal. Additionally, the integrated wireless security supports 64- and 128-bit WEP, WPA, and PA2/WPA-PSK/WPA2-PSK (TKIP/AES) encryption standards, as well as ad-hoc and infrastructure modes. For simpler network encryption setup, the router includes a WPS button and a wireless setup utility helps to simplify initial network setup. The AC600 includes a resource disc and a quick installation guide.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										802.11ac Wi-Fi \n									\n								    \n										\n\n										\n												TP-LINK\'s Archer T2U comes with the Wi-Fi standard 802.11ac, which is up to three times faster than wireless N speeds. With wireless speeds up to 433 Mbps over the 5 GHz band or 150 Mbps over the 2.4 GHz band, the Archer T2U is designed for HD streaming, online gaming, and tasks that require high bandwidth\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										AC600 Wireless Speed \n									\n								    \n										\n\n										\n												The 5 GHz 433 Mbps band is designed for HD video streaming and online gaming, while the 2.4 GHz 150 Mbps'),
