(32522, 2328, 1, 'Netgear R7000 Nighthawk AC1900 Smart Wi-Fi Router R7000-100PAS'),
(32523, 2328, 2, 'The R7000 Nighthawk AC1900 Smart Wi-Fi Router from Netgear uses a dual core 1GHz processor and AC1900 Wi-Fi technology to deliver speed and performance that\'s perfect for gaming and streaming HD video. It supports both 2.4GHz and 5.0GHz wireless frequencies, providing up to 1900 Mbps (600 on the 2.4 GHz band and 1300 on the 5.0 GHz band) data transfer rates.The Nighthawk router utilizes Beamforming+ technology, meaning that unlike omnidirectional Wi-Fi which fans the signal out within a range, it communicates directly with devices such as tablets or smartphones, and beams a signal specifically to the device. This reduces interference, and provides stronger, faster, and more reliable connections. Mobile Wi-Fi speeds are much faster than previous technology thanks to the router\'s high-powered amplifiers and antennas.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Advanced upstream and downstream QoS optimize gaming and streaming.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												The router is iTunes compatible, so you can play music that is stored on a hard drive or USB memory stick through AirPlay or Apple Remote.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Netgear Genie provides a personal dashboard to monitor, control & repair your home network.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												ReadySHARE allows you to wirelessly access and share a USB hard drive and printer across your wireless network via two USB ports.'),
