(32547, 2330, 1, 'Netgear AC600 Dual Band Wi-Fi USB Mini Adapter A6100-100PAS B&H'),
(32548, 2330, 2, 'The AC600 Dual Band Wi-Fi USB Mini Adapter from NETGEAR is compatible with any standard Wi-Fi router. It wirelessly upgrades your Windows-based notebook computer to AC Wi-Fi speeds. The compact, mini-adapter is suitable for mobility and allows you to experience lag-free, HD streams throughout your home, online gaming and offers a secure and reliable connection to the Internet. With up to 150/433 Mb/s speed, Dual Band and Beamforming+, the A6100 avoids interference ensuring top Wi-Fi speeds and reliable connections. The easy-setup NETGEAR genie offers optimal speed, while Push \'N\' Connect gives you a secured connection at the push of a button.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Extended range and performance with 802.11ac (150/433 Mb/s)\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Beamforming+ technology boosts speed, range, and reliability\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Works with any standard Wi-Fi Router or Modem Router/Gateway such as Belkin, Linksys, D-Link, NETGEAR, and others\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Dual band reduces interference for better connections to more Wi-Fi devices\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Works with 802.11 a/b/g/n and ac Wi-Fi routers\n										  \n										 \n				                        \n				            		\n				           '),
