(32570, 2344, 1, 'TP-Link TL-WDR3600 N600 Wireless Dual Band Gigabit TL-WDR3600'),
(32571, 2344, 2, 'With the increased demand put on our Wi-Fi networks, the TL-WDR3600 N600 Wireless Dual Band Gigabit Router from TP-Link comes equipped to meet all of your wireless networking needs. This high tech router comes with the ability to broadcast and receive both 2.4GHz and 5GHz connections simultaneously at 300Mbps. Along with dual band wireless, the WDR3600 comes outfitted with two USB ports giving you the ability to plug in a wide variety of devices directly into the router making them available throughout the network. \n\n\nThe ability to allow for simultaneous connections makes this router stand out among similar routers. With dual band connectivity you can run specific devices that require less bandwidth on the 2.4GHz frequency as this frequency is often times more congested, making it less efficient for higher bandwidth applications. The 5.0GHz frequency can then be left to applications and devices requiring faster, larger amounts of bandwidth such as HD video streaming, streaming music, and transferring of large files. This allows the entire network to work more efficiently, as network traffic can be allocated to specific frequencies. \n\n\nThe integrated USB ports found on the back of the router make the WDR3600 a multimedia hub. Simply connect your hard drive or multimedia hub directly into one of the router\'s USB ports, and make all of your media available throughout the network. The built-in media server makes sharing your music, video, and photos with devices such as Windows Media Player, PS3, or X-Box 360 a breeze. The WDR3600 is also equipped with print server capabilities, allowing for wireless printing from different computers throughout the network. \n\n\nOnce configured, your router becomes a gateway to all of your media and a window to the World Wide Web. As this is the case, you must secure your network to be sure your sensitive data remains safe. To do this, you can take advantage of a variety of security features found on the WDR3600. Initially, you can utili'),
