(32592, 2346, 1, 'D-Link  Wireless N Nano USB Adapter DWA-131 B&H Photo Video'),
(32593, 2346, 2, 'The Wireless N Nano USB Adapter from D-Link is a compact Wi-Fi adapter, compatible with Windows computer systems. The adapter connects to your computer via USB 2.0 -- its small physical design makes it a great option for notebook systems, as it won\'t jut out too far from the system during mobile use.\n\nAdding the adapter to your system allows you to connect to Wi-Fi networks at 802.11n speeds -- much faster than that of the earlier 802.11g and 802.11b standards. Of course, it is fully compatible with 802.11b/g networks! The adapter offers full support for WPA, WPA2, and WPS security standards, helping to ensure that unauthorized users cannot snoop on your wireless data transfers.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Slim and compact design\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Compatible with 802.11n, 802.11g, and 802.11b networks\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Compatible with notebook and desktop systems running Windows\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Supports WPS (Wi-Fi Protected Setup), which allows you to secure your data connection with the push of a button\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Also supports WPA and WPA2 data encryption'),
