(32615, 2342, 1, 'D-Link Wireless AC1750 Dual Band Gigabit Cloud Router DIR-868L'),
(32616, 2342, 2, 'The Wireless AC1750 Dual Band Gigabit Cloud Router from D-Link is compatible with both 2.4GHz and 5GHz frequencies allowing you to allocate your data to one of two frequencies for enhanced data speeds of up to 1300Mbps on the 802.11ac standard. Assign less data intensive tasks such as web browsing and e-mail to the standard 2.4GHz frequency, while keeping the more data intensive tasks to the less congested more efficient 5GHz frequency. Along with enhanced wireless 802.11a/b/g/n/ac standards, you also benefit from four gigabit LAN ports, one gigabit WAN port, and one USB 3.0 port.\n\n\nTake full advantage of the cloud functionality of this router by connecting an external hard drive directly to the integrated USB 3.0 port. Once connected, utilize any one of the mobile apps including SharePort Mobile, QRS Mobile, and mydlink Lite to easily access your files while on the go. The USB 3.0 port is also compatible with USB printers as this D-Link router comes equipped SharePort Plus printer sharing.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Upgrade to AC Performance \n									\n								    \n										\n\n										\n												The D-Link Wireless AC1750 Dual Band Gigabit Cloud Router delivers enhanced wireless speed and coverage to all your Wi-Fi devices. With wireless dual\nband speeds of 450 and 1300Mbps, the DIR-868L avoids interference to deliver the improved wireless speeds and coverage with reliable connections. The DIR-868L is\nideal for streaming HD video, gaming, connecting multiple devices, and streaming content directly to your TV - all at the same time. D-Link\'s free mobile\napps provide easy setup, remote monitoring and access to content from anywhere on\nyour smartphone or tablet.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Backward Compatibility \n							