(32639, 2345, 1, 'D-Link DGS-1100 EasySmart 24-Port Gigabit Ethernet DGS-1100-24'),
(32640, 2345, 2, 'The DGS-1100 EasySmart 24-Port Gigabit Ethernet Switch from D-Link is a managed switch designed to operate quickly, efficiently and economically with your network while still giving you a load of useful, sophisticated features. Capable of sitting on your desktop or in a 1U rack mount, this switch features 24 Gigabit ports for connecting different devices in your LAN and transferring data at high speeds. As part of the switch\'s more advanced features, you can setup port-based or tag-based VLANs on your network as well as a surveillance VLAN with video cameras. This switch is particularly designed to setup and execute a surveillance VLAN, so as to spare you the costs of dedicating hardware or even facilities to do so. In addition to segmenting up your network into VLANs, you can also reserve bandwidth for more important functions and utilize the supported QoS for prioritizing traffic for important or latency-sensitive applications, such as video streaming or VoIP. Beyond these features, the switch supports IGMP snooping so to optimize performance for multicasting applications. So as to operate more efficiently, the switch is designed to be compliant with IEEE802.3az Energy Efficient standards. It also features D-Link Green technology. Both of these features reduce the amount of power that the switch uses without adversely affecting its performance. For integration and management, the switch features a web-based management interface that allows you to remotely control your network down to the port level. In addition, the switch features a SmartConsole utility that allows you to setup connections with other D-Link Smart and Easy Smart Switches within the same L2 network segment. With all these features as well as built-in security and trouble-shooting, you don\'t need to be in MENSA to realize that this EasySmart Ethernet Switch is an invaluable resource and a stellar buy for your small or medium-sized business.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				          '),
