(32685, 2351, 1, 'D-Link  DAP-1320 Wireless Range Extender DAP-1320 B&H Photo Video'),
(32686, 2351, 2, 'The DAP-1320 Wireless Range Extender from D-Link extends your existing wireless network coverage with the push of a button, delivering up to 300Mbps for whole-home or office coverage. Ideal for hard-to-reach areas like basements, upstairs bedrooms, outdoor areas and even small offices, the compact Wireless Range Extender gives takes your network to places it has never been.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Enhanced Coverage \n									\n								    \n										\n\n										\n												This Wireless N Range Extender uses Wireless N technology with multiple intelligent antennas to maximize the speed and range of your wireless signal to significantly outperform previous-generation Wireless G devices. The antennas make use the surrounding environment by bouncing multiple wireless signals off walls and ceilings to work around obstructions and help eliminate dead spots.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Reduce Dead Spots \n									\n								    \n										\n\n										\n												Place the Wireless Range Extender between your wireless router and your wireless devices to create wall-to-wall coverage while eliminating dead zones\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Push Button Setup \n									\n								    \n										\n\n										\n												Press the WPS button on your router\nPress and hold the WPS button on the Wireless Range Extender until the LED indicator starts flashing and then release\nYou\'re successfully connected'),
