(32708, 2350, 1, 'TP-Link TL-WN823N Wireless-N300 Mini USB Adapter TL-WN823N B&H'),
(32709, 2350, 2, 'The TL-WN823N Wireless-N300 Mini USB Adapter from TP-Link is small yet extremely capable, enabling you to easily configure your Wi-Fi connection. The efficient TL-WN823N Wi-Fi adapter provides speeds of up to 300Mbps, making it ideal for HD video streaming, VoIP calls, and even online gaming. \n\n\nThe TL-WN823N not only allows you to connect to local Wi-Fi networks, it also comes equipped with SoftAP mode, making it easy to share your current wired Internet connection. Simply enable SoftAP mode when connected to your existing wired connection, and share it with other Wi-Fi enabled devices effectively eliminating the need for a wireless router. \n\n\nSetup is a breeze for the TL-WN823 as it comes outfitted with a WPS (Wi-Fi protected setup) button and quick security setup, allowing you to instantly setup your wireless security with the press of a button. The WPS button creates a WPA2 secure connection, giving you piece of mind that your connection will remain secure when compared to the older WEP encryption standards.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Portable Powerhouse \n									\n								    \n										\n\n										\n												This mini-sized USB Wi-Fi adapter packs a punch with wireless n speeds of up to 300Mbps, making it an ideal adapter for HD video streaming, online gaming and even VoIP calls.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Advanced MIMO Technology \n									\n								    \n										\n\n										\n												MIMO or multiple-input / multiple-output, is the use of multiple antennas at both the transmitter and receiver to improve communication performance. This technology involves the use of inputs and outputs with regards to the channel carrying the signal, not the device itself having multiple antennas. The implementation of MIMO technology within the WN823N Wi-Fi adapter allows for a more eff'),
