(32731, 2349, 1, 'TP-Link TL-WA850RE N-300 Universal Wi-Fi Range TL-WA850RE B&H'),
(32732, 2349, 2, 'The TL-WA850RE N-300 Universal Wi-Fi Range Extender  from TP-Link is designed to conveniently extend the coverage and improve the signal strength of an existing wireless network to eliminate "dead zones". With 300 Mb/s wireless N speeds, a Range Extender button, miniature size, and wall mounting design, extending a wireless network has become user-friendly.  Furthermore, the Ethernet port allows the range extender to act as a wireless adapter to turn a wired device into a wireless one.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										300 Mb/s Range Extender \n									\n								    \n										\n\n										\n												The range extender is designed to conveniently extend the coverage and improve the signal strength of an existing wireless network to eliminate "dead zones." This helps you to maintain an existing wireless network and vastly improve the network\'s coverage. With 300 Mb/s wireless 802.11n speeds, it is suitable for smooth HD video, music streaming, and online gaming.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Flexible Deployment \n									\n								    \n										\n\n										\n												The miniature size and wall-mounted design make it easy to deploy and move flexibly. Furthermore, the range extender profile function remembers previously paired wireless networks. There is no need to reset the device when changing the paired router.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Ethernet Bridge \n									\n								    \n										\n\n										\n												Its single Ethernet port allows the extender to function as a wireless adapter to connect wired devices like Blu-ray players, gaming consoles, DVRs, and Internet TVs. At the same time, the device can share the wireless network as well\n										  \n						'),
(32733, 2349, 3, 'B&H#TPTLWA850RE'),
(32846, 2362, 1, 'D-Link DIR-850L AC1200 Dual Band Gigabit Cloud Router DIR-850L'),
(32847, 2362, 2, 'The DIR-850L AC1200 Dual Band Gigabit Cloud Router from D-Link comes equipped with dual band 2.4GHz / 5GHz functionality allowing you to allocate activities such as email and web browsing to the 2.4GHz frequency, while keeping more data intensive tasks such as streaming HD content, gaming and more to the less congested 5GHz frequency. Along with dual band functionality, you can also take advantage of enhanced IEEE 802.11ac performance with data speeds up to 867Mbps. \n\n\nAlong with wireless connectivity, you can also take advantage of four Gigabit Ethernet ports for fast, stable, wired connections. Above the Ethernet ports lies one USB 2.0 port to connect a variety of USB enabled devices such as external hard drives, USB printers and more. Once your USB device is connected you can take advantage of the D-Link SharePort Mobile app to access your data from a compatible tablet or smartphone.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Upgrade to AC Performance \n									\n								    \n										\n\n										\n												The D-Link Wireless AC1200 Dual Band Gigabit Cloud Router (DIR-850L) delivers enhanced wireless speed and coverage to all your Wi-Fi devices. With wireless dual band speeds of 300 and 867Mbps, the DIR-850L avoids interference for improved coverage and reduced interference. The DIR-850L is ideal for streaming HD content, gaming, connecting multiple devices, and streaming shows directly to your TV all at the same time. The DIR-850L is also backward-compatible with existing wireless 802.11a/g/n devices for seamless connectivity. With D-Link\'s free mobile apps you benefit from easy setup, remote monitoring and access to content from anywhere on your Smartphone or Tablet.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Dual Band Advantage \n									\n								    \n										\n\n										\n												The Wireless AC120'),
