(32754, 2348, 1, 'D-Link DWA-182 Wireless AC1200 Dual Band USB Adapter DWA-182 B&H'),
(32755, 2348, 2, 'The DWA-182 Wireless AC1200 Dual Band USB Adapter from D-Link comes equipped with dual band capability. The integrated dual band technology enables the adapter to function on both the 2.4GHz and 5.0GHz frequencies, ensuring increased clarity. You can utilize the 2.4GHz frequency for tasks such as surfing the Internet, whereas the 5.0GHz frequency supports streaming HD quality content, transferring large files, and video chatting. \n\n\nThe DWA-182 provides enhanced security options including WPS push button setup, WPA, and WPA2 encryption standards. These enhanced security features allow you to control your own security options regardless of the network you are connected to. The diagnostic LED keeps you notified of when data is being transferred to and from your PC or laptop. This is all made possible through the integrated antenna, making the DWA-182 small enough to fit into nearly any USB port.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Interference-Free Bandwidth \n									\n								    \n										\n\n										\n												The Wireless AC1200 Dual Band USB Adapter delivers Dual Band technology to your home network for intelligent, versatile, interference-free bandwidth. Check your email and surf the Internet on the 2.4GHz band; or game, make Skype calls and stream HD movies to multiple devices using the cleaner, interference-free 5GHz band.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Easy WPS Push Button Setup \n									\n								    \n										\n\n										\n												Quickly and easily establish a fast, secure some network that will have you browsing, streaming, and watching in minutes.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Enhanced Compatibility \n									\n								    \n										\n\n										\n					'),
