(32892, 2367, 1, 'TP-Link AC1900 Archer C9 Dual-Band Gigabit Router ARCHER C9 B&H'),
(32893, 2367, 2, 'The TP-Link AC1900 Archer C9 Dual-Band Gigabit Router supports 802.11ac speeds that deliver a combined speed up to 1.9 Gbps. This router supports the 2.4 GHz bandwidth that offers 600 Mbps speeds useful for web surfing, emailing, and other basic functions, while the 5 GHz band, which provides 1300 Mbps, is better for streaming HD videos, playing online games, and more.\nThe Archer C9 is equipped with three detachable Beamforming antennas for providing reliable and a wide wireless coverage. It is also built with a 1 GHz dual-core processor to ensure no interruptions when simultaneously processing multiple wireless or wired tasks. In addition, it comes with two USB ports and five gigabit Ethernet ports.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Reliable Wi-Fi Coverage \n									\n								    \n										\n\n										\n												Three dual-band antennas and high-powered amplifiers ensure continuous Wi-Fi signal to all your devices while boosting widespread coverage throughout your home or office\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Beamforming Technology for Laser-Focused Wi-Fi \n									\n								    \n										\n\n										\n												Beamforming concentrates the Wi-Fi signals towards your Wi-Fi devices to increase the Wi-Fi range as well as deliver targeted and efficient Wi-Fi connections\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Dual USB Ports \n									\n								    \n										\n\n										\n												With a USB 3.0 port and a USB 2.0 port, it\'s easy to share local printers, files and media within the network and between devices. You can also utilize a FTP server to access files stored on the router while away home. Take advantage of USB 3.0 with 10x faster speed than traditional USB 2.0\n								'),
