(32822, 2361, 1, 'TP-Link TL-WDR4300 Wireless-N750 Dual Band Gigabit TL-WDR4300'),
(32823, 2361, 2, 'The TL-WDR4300 Wireless-N750 Dual Band Gigabit Router from TP-Link is optimized to combine the speed of 802.11n wireless technology, with the clarity and power of dual band antennas. With built-in printer support and USB 2.0 ports you can connect an even wider range of devices to print and transfer files wirelessly, and from any device on the network.\n\nUsing the traditional 2.4 GHz band you can easily browse, chat, email, and more at speeds of up to 300 Mbps, just as you\'ve always done, while with the 5.0 GHz band you\'ll experience less interference from other wireless or bluetooth devices. This allows you to upload, download, and stream large media files to multiple devices at up to 450 Mbps. For more latency intensive programs, like online gaming, you\'ll experience clearer signals, faster connection speeds, and less lag than you would on previous wireless routers.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												Simultaneous 2.4 GHz and 5.0 GHz connections provide 300 Mbps and 450 Mbps transfer rates, respectively. This combines to a total available bandwidth of 750 Mbps, great for streaming music, movies, and online games\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												With two convenient USB 2.0 ports, your network-connected users and devices can share files through the router\'s FTP server. Having a built-in media server allows you to share music, video and photos with Windows Media Player, a Sony PS3, or Microsoft X-BOX 360--or print wirelessly\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Achieves blazing WAN to LAN throughput of over 800 Mbps with hardware NAT\n										  \n										 \n				       '),
