(33054, 2369, 2, 'The TP-Link TL-WR841N Wireless N Router provides wired and wireless network connection with a 4-port switch that allows wireless access to multiple devices in your home without running unsightly wires.The TL-WR841N is backward compatible with 802.11b and g and thanks to Align technology from Atheros Communications Inc., is forward compatible with higher-performance, multi-stream, MIMO-based 802.11n which offers an impressive 300Mbps at a very reasonable price. Besides high speed, 802.11n gives you great performance even at long distances, as well as an SPI firewall to prevent your network from being compromised. Other security features include SSID broadcast control, MAC address access control, WEP encryption, WPA/WPA2, and WPA-PSK/WPA2-PSK authentication. It has dual external antennas to enhance transmission rates and coverage while CAA technology prevents channel conflicts. Besides home use, the TL-WR841N is a great choice for businesses since it offers priority, support and stability to large bandwidth-consuming applications which are subject to interruptions, like voice and video.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												2 detachable omni-directional antennas\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Supports PPPoE, Dynamic IP, and static IP broadband functions\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Automatic dialing, on-demand dialing, fixed-time dialing, filling most dialing requirements\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n									'),
