(33100, 2371, 2, 'The 24-Port 10/100 Mbps Ethernet Rackmount Switch from D-Link is a 24-port Ethernet switch that can operate at 10/100 Mbps speeds. The switch features Store and Forward packet-switching and Auto Uplink ports for automatic MDI/MDI-X detection. The switch features a 1U rackmount form factor, making it an excellent addition to your network. \n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Ease of Use \n									\n								    \n										\n\n										\n												The switch is designed for use in small business environments. It features plug and play installation, a 1U rackmount form factor, and an 8K MAC address table. It is an excellent option for businesses that do not require the features of more advanced, managed switches.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Autosensing MDI/MDI-X Ports \n									\n								    \n										\n\n										\n												Every port on the switch is autosensing MDI/MDI-X, so you won\'t have to worry about switching between standard Ethernet and crossover cables when configuring your network.'),
