(33122, 2381, 1, 'ASUS Dual Band Wireless-AC1200 Gigabit Router RT-AC56U B&H Photo'),
(33123, 2381, 2, 'The Dual Band Wireless-AC1200 Gigabit Router from ASUS features 802.11ac wireless connectivity for enhanced data speeds of up to 867MBps, as well as dual band 2.4GHz/5GHz frequencies simplifying the process of allocating data intensive tasks. Along with enhanced wireless connectivity, this ASUS router comes equipped with four Gigabit Ethernet ports a providing stable, reliable, wired connection option.\n\nNext to the four Gigabit Ethernet ports on the back of the router, you find two USB ports, one USB 2.0 port and one USB 3.0 port. These ports make it possible to connect peripherals such as external hard drives allowing you to stream your content including videos, movies, music and more to both iOS and Android devices. You can also plug a USB compatible printer into one of the USB ports and share that printer throughout the entire network. Once configured, you can manage your entire network through the intuitive ASUS WRT dashboard.\n\nAs with many routers, you can encrypt your network and configure firewalls. This ASUS router comes with comprehensive data encryption standards including 64-bit WEP, 128-bit WEP, WPA2-PSK, WPA-PSK, WPA-Enterprise, WPA2-Enterprise, Radius with 802.1x, and WPS support keeping your entire network and the data within it safe and secure. Along with encryption standards, you can utilize both firewall and access control standards including SPI intrusion detection, DoS protection, parental controls, network service filters, URL filters, and port filters.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										IEEE 802.11ac Wi-Fi Connectivity \n									\n								    \n										\n\n										\n												Powered by 5th generation Wi-Fi (5G Wi-Fi), the 802.11ac Broadcom chipset gives the RT-AC56U enhanced Gigabit wireless speeds. Compared with current 802.11n, the RT-AC56U delivers up to 867Mbps at 5GHz, which is 3X faster than previous 802.11n 2x2 routers. The upgraded bandwidth has the higher capacity needed to increase W'),
