(33145, 2382, 1, 'Linksys  EA6300 Smart Wi-Fi Router EA6300 B&H Photo Video'),
(33146, 2382, 3, 'B&H#LIEA6300'),
(33147, 2382, 2, 'The Linksys EA6300 AC 1200 Advanced Multimedia Smart Wi-Fi Router is built with 802.11ac wireless technology that offers maximum speed and range to create a powerful network. It offers fast transfer rates and is designed for top-notch performance and connectivity for your computers, Internet-ready television (Smart TVs), game consoles, smartphones, and other Wi-Fi devices.Upgrade to the latest wireless-AC technology and enjoy seamless video streaming and fast content sharing across devices by using the EA6300 Smart Wi-Fi Router. Its wireless-AC technology provides gigabit Wi-Fi speeds and high-powered signal amplifiers, allowing large video or music files to download faster and sync more quickly for a better streaming and sharing experience.With the EA6300 Smart Wi-Fi Router, you have double the network bandwidth with simultaneous dual-band AC (2.4 GHz and 5 GHz bands) and an additional Guest network.All these features enable your network and its connected devices to avoid interference, have smoother and faster HD video streaming and file transfers, as well as experience better wireless gaming.For your connected home, you may use the 2.4 GHz network to connect your wireless devices to surf the Internet and email, share files, and print.The 5 GHz network is best for heavy applications including Voice over IP (VoIP) calls, online gaming, and streaming high-definition videos.The included SimpleTap Card is a faster and easier way to connect your NFC (Near Field Communication)-compatible smartphone to the EA6300 Smart Wi-Fi Routers 2.4 GHz wireless network.\n			\n		\n		\n		   \n	   		Note:\n		 	 Maximum performance derived from IEEE Standard 802.11 specifications (draft specifications for 802.11ac). Actual performance can vary, including lower wireless network capacity, data throughput rate, range, & coverage, & depends on many factors including products used & interference. 802.11ac 1300 Mbps in the 5GHz Band is approximately 3x faster than 802.11n 450 Mbps in the 2.4GHz B'),
