(33191, 2380, 1, 'TP-Link TL-SF1024D 24-Port 10/100Mbps Switch TL-SF1024D B&H'),
(33192, 2380, 2, 'The TL-SF1024D 24-Port 10/100Mbps Switch from TP-Link allows for ease of use and high performance in an energy efficient configuration. With innovative energy-efficient technology you can save up to 70% off of your power consumption while streamlining your network. With IEEE 802.3x flow control you can utilize Full Duplex mode and Half Duplex mode to relieve backpressure throughout the network. \n\n\nReceive full wire-speed for maximum throughput with non-blocking switching architecture and 4.8Gbps switching capacity to ensure fast efficient data transfer. The store and forward switching scheme allows the switch to store data in a specific node to verify the integrity of the message before forwarding it. This in turn allows for more efficient flow of data as each packet is inspected for its integrity. \n\n\nAuto MDI/MDIX provides the means for parallel connections to eliminate the need for crossover cables to interconnect switches or connect PCs peer-to-peer. The integrated MAC address auto-learning and auto-aging feature allows for seamless integration of devices into the network as the switch can recognize the device by its MAC address. With auto negotiation ports and smart integration the switch can integrate devices between 10 and 100Mbps to ensure proper network speeds.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Ease of Use \n									\n								    \n										\n\n										\n												The TL-SF1024D provides a high-performance, low-cost, easy-to-use, seamless upgrade improving old networks to 100Mbps speeds. With 24 auto MDI/MDIX ports, there\'s no need to worry about the cable type. The plug and play compatibility of this switch allows for easy installation. Once installed you will begin saving up to 70% off of your power consumption.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										High Performance \n									\n								    '),
