(33215, 2378, 2, 'The DES-105 5-Port 10/100 Fast Ethernet Switch from D-Link provides five Fast Ethernet auto-sensing ports for connecting multiple computer devices to your network. Once you\'ve connected the switch to your network via one Fast Ethernet port, you will have four other ports for connecting printers, scanners, storage, backup devices, and more. Support for Quality of Service (QoS) means the switch will prioritize network traffic that is sensitive to lags, such as video streaming or VoIP calls. \nThe switch is unmanaged and plug-and-play, so you need not install software first to use it or configure settings for it later. Plus, the diagnostic LEDs on the front panel let you know if there are any connection issues, helping you troubleshoot problems as they arise.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n								    \n										\n\n										\n												5 Port 10/100 Fast Ethernet Ports\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Plug-n-Play Installation\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Dlink Green Eco-Friendly Power Design\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Store-and-forward switching scheme\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Support for IEEE 802.3az Energy-Efficient Ethernet (EEE) means the switch will detect when a connected computer is shut down or when there is no Ethernet traffic. At this point, the switch will autom'),
