(33237, 2387, 1, 'ASUS WL-330N 5-in-1 Wireless-N150 Mobile Router WL-330N B&H'),
(33238, 2387, 3, 'B&H#ASWL330N'),
(33239, 2387, 2, 'Smaller than a credit card, the WL-330N 5-in-1 Wireless-N150 Mobile Router by Asus is a compact, multi-functional wireless router. Use it as a router, a universal repeater, hotspot, access point or Ethernet adapter. It can even share 3G signals with smartphones and tablets equipped with an active data plan. Any way you use it you\'ll enjoy the fast 150 Mbps data rate for HD movie and music streaming, VoIP calls, online gaming and more.\nNetwork detection makes setup a breeze and the wizard-based assistant with an intuitive, user-friendly graphic interface couldn\'t make this Plug-n-Surf installation any easier. The WL-330N is USB powered so while there\'s no need to carry along the included power supply, you might want to pack it anyway since it also fits most brands of smartphones.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Ultra-portability with Footprint Smaller Than a Credit Card \n									\n								    \n										\n\n										\n												Its footprint is smaller than a credit card, making it very easy to carry and literally pocket sized, but not at the expense of functionality. This is a full wireless router designed for those on the move, especially businessmen, commuters, students and mobile professionals.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Wireless N - Extreme Wireless Speed \n									\n								    \n										\n\n										\n												Complies with the IEEE 802.11n wireless standard. Create home or office wireless networks with up to 18x the speed and 6x the range of conventional 802.11g networks. Enjoy bandwidth intensive HD movie and music streaming, VoIP calls, online gaming and more, smoothly and lag-free without the worry of data loss over large areas.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n		'),
