(33260, 2385, 1, 'ASUS RT-AC66U Dual-Band Wireless AC 1750 Gigabit Router RT-AC66U'),
(33261, 2385, 2, 'The AC1750 Dual-Band Wireless-AC Gigabit Router from ASUS provides outstanding wireless and Ethernet speeds of 450 Mbps and 1.3 Gbps, respectively, for a total speed of up to 1.75 Gbps! High-definition media enthusiasts and gamers alike will find little left to be desired with this next-generation 802.11ac router.\n\nWith exclusive ASUS features like AiCloud, AiRadar, and ASUSWRT not only will this router be super-fast when downloading large files, movies and playing games, but it provides convenient tools to easily setup, install and optimize it from anywhere. AiCloud is your one-stop service to access, stream and share files with an unlimited amount of storage expansion. AiRadar optimizes the wireless coverage of the router via the high-powered antennas attached to it. With ASUSWRT you can easily setup the router in three steps via the dashboard UI, as well as monitor and control it with the helpful user interface.\n\nWhether you\'re a tech-savvy enthusiast, a casual browser, or first-time user--the AC1750 delivers exceptionally easy-to-use and quick installation, along with fast wired and wireless connectivity. With high-quality components and next-generation technology you\'ll easily be online and downloading faster than any router has let you before.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Surf at 5th Generation High Speed \n									\n								    \n										\n\n										\n												Enjoy high-speed data transfer rates of 802.11ac which is three times faster than 802.11n. The AC1750 router runs at a higher capacity bandwidth in order to increase speeds of all devices around your home--no more clogging the web when everyone wants to surf, watch, and play at once. At 1.3 Gbps on a 5.0 GHz frequency, you and everyone around you can enjoy using notebooks, desktops, tablets, smartphones, and gaming consoles all wirelessly connected to the internet\n										  \n										 \n				                        \n				            		\n				      '),
