(33283, 2386, 1, 'Linksys  EA6400 Smart Wi-Fi Router EA6400 B&H Photo Video'),
(33284, 2386, 2, 'The EA6400 Smart Wi-Fi Router from Linksys features dual band functionality allowing compatible devices to connect to either the 2.4 GHz or 5 GHz frequencies. By connecting to the less congested 5 GHz frequency you benefit from enhanced data transfer rates perfect for transferring large files, streaming HD content, online gaming, and more. \n\n\nAlong with enhanced wireless data transfer speeds, you can also take advantage of four Gigabit Ethernet ports located on the back of the router. These four Ethernet ports allow for a fast, stable, reliable wired data connection. Additionally, you can plug in a variety of USB compatible peripheral devices such as external hard drives and printers to the USB 3.0 port. Once connected those devices become accessible by users throughout the network. \n\n\nThe EA6400 also features Linksys Smart Wi-Fi. This included software application allows you to control your entire network from nearly anywhere. In addition to enhanced network control via the Smart Wi-Fi feature, you can secure your network using WEP, WPA/WPA2-Mixed, WPA2-Personal, and WPA2- Enterprise encryption standards.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Wireless AC \n									\n								    \n										\n\n										\n												Built with the latest Draft 802.11ac technology for enhanced performance and range\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Broad Compatibility \n									\n								    \n										\n\n										\n												Works seamlessly with all a/b/g/n devices\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Simultaneous Dual-Band 2.4 + 5 GHz \n									\n								    \n										\n\n										\n												Double the network bandwidth to avoid interference and maximize throughput\n										  \n										 \n				    '),
