(33306, 2383, 1, 'TP-Link Archer C2 AC750 Dual Band Wireless Gigabit ARCHER C2 B&H'),
(33307, 2383, 2, 'Connect devices to either the 2.4 GHz or 5 GHz frequency with the Archer C2 AC750 Dual Band Wireless Gigabit Router from TP-Link. Dual band functionality allows you to prioritize which devices connect to which frequencies based upon how much bandwidth they require. \n\n\nAlong with dual band connectivity, this router is compatible with IEEE 802.11a/b/g/n/ac network standards. The 802.11ac 5 GHz band offers a maximum data transfer rate of 433 Mbps while the 802.11n 2.4 GHz band offers a maximum data transfer rate of 300 Mbps. Whichever wireless connection is used, all transmissions are kept secure through the use of 64/128-bit WEP, WPA/WPA2, and WPA-PSK/WPA2-PSK encryption standards. \n\n\nFor a fast, reliable wired connection the Archer C2 comes equipped with four Gigabit Ethernet LAN ports and one Gigabit Ethernet WAN port. You can also connect USB compatible peripherals to the USB 2.0 port located on the back of the router. Once connected, the USB device becomes accessible to users throughout the network.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				            	\n				              Wireless and Wired Performance \n				              \n				            \n				    \n				               \n									\n								    \n										\n\n										\n												Supports 802.11ac while remaining backwards compatible with 802.11a/b/g/n networking standards\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Simultaneous 2.4 GHz 300 Mbps and 5 GHz 433 Mbps connections for 733 Mbps of total available bandwidth\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n								    \n										\n\n										\n												Two detachable external antennas provide stable omnidirectional signal and superior wireless coverage\n										  \n										 \n				                        \n			'),
