(33329, 2384, 1, 'D-Link  DIR-865L Cloud Router 5700 DIR-865L B&H Photo Video'),
(33330, 2384, 2, 'Reinvent the home network with the  DIR-865L Cloud Router 5700 from D-Link. With the Cloud Router you can take advantage of the integrated USB 2.0 port to connect a USB drive, enabling you to stream your media at blisteringly fast speeds of up to 1300Mbps throughout your network. Along with the ultra fast media transfer speeds, you can also benefit from up to 450Mbps Internet Wi-Fi as well as four Gigabit Ethernet ports.\n\n\nWith 802.11ac connectivity, you can stream your media throughout the network at speeds of up to 1300Mbps, allowing for flawless rendering of all of your media on a variety of Internet connected devices. Simply connect a USB drive into the USB port located on the back of the router, and make all of your media available through the free SharePort Mobile App. With the ability to stream data, you no longer need to worry about running out of space on your device. The wireless 802.11n connectivity allows for an ultra fast Internet connection. \n\n\nThe Cloud Router is great for large spaces such as small offices, small warehouses, and large homes. With 5Ghz Wi-Fi connectivity you get a stronger signal, reaching places traditional routers cannot reach. With increased coverage you need increased security as the network will become visible to more individuals. With the Cloud Router, you can configure your router\'s security settings from your iPhone, iPad, or Android device with the free QRS Mobile application. The integrated push-button connectivity and 128-bit security encryption standard makes adding devices to your network fast and easy.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Media Dream Come True \n									\n								    \n										\n\n										\n												The D-Link Cloud Router provides revolutionary Gigabit 802.11ac wireless speeds up to 1750Mbps allowing for flawless HD video streaming to multiple devices. The integrated 802.11ac wireless capabilities provide up to 3 times faster data speeds over conventiona'),
