(33378, 2389, 2, 'The EA6500 Linksys Smart WiFi Router from Cisco is smarter than your average router. The EA6500 Router comes equipped with dual-band connectivity, four Gigabit Ethernet ports, DLNA media server, and Cisco\'s Connect Cloud App. \n\n\nThe integrated dual band frequencies included in the EA6500 Router enable you to utilize both the 2.4GHz and 5GHz frequencies to provide for reduced interference with other electronic devices around the house. With four Gigabit Ethernet ports you have a stable, super fast connection option for streaming HD quality content, transferring large files, and streaming music. The DLNA (digital living network alliance) media server allows you to easily stream your media throughout your network to other DLNA certified devices. Cisco\'s Connect Cloud App comes equipped with a variety of options such as adding new devices to the network, setting parental controls, providing guest access, and prioritizing media. \n\n\nWith six antennas accompanied by high power amplifiers you can take advantage of ultimate range. As a result, your WiFi signal will reach areas traditional routers cannot reach. Along with the antennas, you can also take advantage of SpeedBoost technology providing increased signal strength.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Cisco Connect Cloud \n									\n								    \n										\n\n										\n												Now available for Linksys Smart WiFi Routers, Cisco Connect Cloud gives you anytime, anywhere access to your home network.\nThis revolutionary new technology delivers a host of free apps for your router. As new devices and ways of interacting with your home emerge, Cisco Connect Cloud will keep expanding with new apps to enrich your connected lifestyle.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										How It Works \n									\n								    \n										\n\n										\n												Create your wirel'),
