(33398, 2392, 1, 'TP-Link TL-WA860RE N-300 Wi-Fi Range Extender with AC TL-WA860RE'),
(33399, 2392, 2, 'The TL-WA860RE N-300 Wi-Fi Range Extender with AC Passthrough from TP-Link is designed to conveniently extend the coverage and improve the signal strength of an existing wireless network to eliminate "dead zones". With 300 Mb/s wireless N speeds, a Range Extender button, miniature size, and wall mounting design, extending a wireless network has become user-friendly.  Furthermore, the Ethernet port allows the range extender to act as a wireless adapter to turn a wired device into a wireless one.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										300 Mb/s Range Extender \n									\n								    \n										\n\n										\n												The range extender is designed to conveniently extend the coverage and improve the signal strength of an existing wireless network to eliminate "dead zones." This helps you to maintain an existing wireless network and vastly improve the network\'s coverage. With 300 Mb/s wireless 802.11n speeds, it is suitable for smooth HD video, music streaming, and online gaming.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Flexible Deployment \n									\n								    \n										\n\n										\n												The miniature size and wall-mounted design make it easy to deploy and move flexibly. Furthermore, the range extender profile function remembers previously paired wireless networks. There is no need to reset the device when changing the paired router.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Ethernet Bridge \n									\n								    \n										\n\n										\n												Its single Ethernet port allows the extender to function as a wireless adapter to connect wired devices like Blu-ray players, gaming consoles, DVRs, and Internet TVs. At the same time, the device can share the wireless network as well\n										'),
