(33443, 2391, 1, 'Linksys EA6900 Smart Wi-Fi Dual Band AC1900 Router EA6900 B&H'),
(33444, 2391, 2, 'The EA6900 Smart Wi-Fi Dual Band AC1900 Router from Linksys features wireless AC technology offering enhanced wireless data transfer speeds able to reach further than traditional wireless protocols. Along with integrated wireless AC technology, this Linksys router supports both 2.4GHz and 5GHz frequencies making it possible to allocate less data intensive tasks such as web browsing and email to the 2.4GHz frequency, while keeping the faster 5GHz frequency open to tasks such as streaming HD content and transferring large files.\n\n\nThe Linksys EA6900 Dual Band Router also features four Gigabit Ethernet ports for a stable, wired connection option. Also found on the back of the router are one USB 2.0 port and one USB 3.0 port designed to support peripherals such as external hard drives and printers. Once connected, users throughout the network can access and utilize the attached devices. \n\n\nSecurity is a major concern when administering a network, and the Linksys EA6900 covers all the bases. Setup and configure parental controls and guest access to limit user access to various parts of the network and the Internet. You can also utilize WEP, WPA, WPA-2 mixed, WPA2 personal, WPA2 enterprise, and Wi-Fi Protected Setup advanced encryption standards for enhanced network security.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Wireless AC Technology \n									\n								    \n										\n\n										\n												The Linksys EA6900 uses the next generation Wireless AC technology for powerful networking.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Up to 4.3X Faster than Wireless N \n									\n								    \n										\n\n										\n												With the Linksys EA6900 you experience speeds approximately 4.3x faster than Wireless N (N600+AC1300).\n										  \n										 \n				                        \n				            		\n				               \n\n			'),
