(33468, 2394, 2, 'The RP-N53 N600 Wireless Dual-Band Range Extender from ASUS is a Wi-Fi range extender that ensures full coverage with internal MIMO antennas. Its repeater functionality can expand wireless home networking to remote areas of your home. It provides high speed internet coverage for notebooks, tablets, smart phones, game consoles, and smart TVs. With enhanced reception, you can enjoy gaming and HD multimedia streaming .\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Dual-Band Concurrent Range Extender \n									\n								    \n										\n\n										\n												The dual-band range extender supports dual-band networking even if you are on an older single-band router. It doubles the wireless performance up to 300 Mb/s bandwidth in 2.4 GHz and 5 GHz simultaneously. The 2.4 GHz band handles daily tasks like web browsing and social networking, while the 5 GHz band is for HD video streaming and online gaming.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Wireless Media Playback \n									\n								    \n										\n\n										\n												You can enjoy all your favorite music with wireless convenience using the N600 wireless extender and ASUS AiPlayer. It offers compatibility with a complete range of multimedia formats, which means smooth and effortless streaming and plug-and-play enjoyment.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										One-Press Setup and Connectivity \n									\n								    \n										\n\n										\n												The N600 dual-band range extender installation doesn\'t require a CD or a mouse or keyboard. Single press of the WPS button completes the setup. For detailed management, you can simply connect the wireless extender to a PC via an Ethernet cable to access the configuration page directly or set it up from '),
