(33491, 2395, 2, 'With dual-band connectivity and MU-MIMO (multi-user MIMO) capabilities, the E8350 AC2400 Dual-Band Gigabit Wi-Fi Router from Linksys can handle multiple tasks such as online gaming, transferring of large files, and more all at the same time. Four detachable external antennas support a 4x4 data stream configuration while integrated beamforming technology directs the signal right at connected devices. \n\nOnce connected, you can leverage the power of this router\'s 1.4 GHz dual-core processor and 512MB of DDR3 RAM to obtain a maximum wireless data transfer rate of 2.33 Gbps. Should you opt for a wired connection, the E8350 comes equipped with four Gigabit LAN and one Gigabit WAN ports along with one USB 3.0 and one USB 2.0/eSATA combo port. The USB ports found on the back of the router allow you to take advantage of the router\'s integrated media server functionality making it easy to stream multimedia content from a connected USB device to compatible devices throughout the network.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Wireless-AC Technology \n									\n								    \n										\n\n										\n												Unlike traditional routers that deliver two or three data streams, the AC2400 uses 4x4 AC technology to deliver four simultaneous, independent streams of data at speeds up to 2.33 Gbps. Ideal for streaming HD videos or playing online games, the AC2400 Wireless-AC Router delivers enhanced data speeds and virtually uninterrupted connectivity. As a result, you can enjoy online gaming and video streaming without annoying lag or buffering.\n\nUsing the Wireless-AC standard, the AC2400 also delivers innovative beamforming technology, enabling the router to strengthen the wireless signal to specific devices, rather than simply sending out a Wi-Fi signal in a general direction. Now you can experience faster network speeds, better wireless range, reduced interference from other devices, and stronger Wi-Fi connections.\n										  \n									'),
