(33514, 2393, 2, 'Hands-On Review: ASUS Tri-Band Router\n						Read More \n					\n				\n			\n		\n	\n	\n	\n	\n\n		\n		\n		\n		\n		\n			\n				\n\n\n\n\n\n\n	\n		\n	\n	\n\n\n\n				The AC2400 Wireless Dual-Band Gigabit Router from ASUS is a versatile, high-performance router, designed to effectively work with a wide variety of wireless and wired devices on your network. It delivers speeds of up to 1734 Mb/s at 5 GHz, and concurrent 600 Mb/s speeds at 2.4 GHz for a total bandwidth of 2334 Mb/s. This means the router gives you lag-free online gaming, 4K/UHD video streaming, and effortlessly copes with even the most bandwidth-demanding tasks. In addition to this, it features fast file-sharing of large files and low-latency online gaming. \n\nWith a separate high-gain antenna for each of the four spatial data streams, this power-packed router gives you true 4x4 multi-user MIMO (MU-MIMO) wireless performances and is designed with AiRadar universal beamforming, for unrivaled multi-device performance and wireless signal coverage up to 5000\'. It delivers top performance for all your wireless devices, even those using older Wi-Fi standards. As with all ASUS networking products, you get the support with the widest range of device compatibility, plus free firmware updates for years to come, so your router will always be at the forefront. \n\nThe router has built-in USB 3.0 and USB 2.0 ports for up to 10-times faster data transfers to USB storage devices, printer sharing, and 3G/4G dongle support. It has ASUSWRT graphical user interface for easy, CD-free 30-second setup, and hassle-free advanced network control. The router features AiProtection with Trend Micro with triple-strength total network security, plus parental controls, and privacy protection. ASUS AiCloud 2.0 lets you access, sync, share, and stream your files anywhere, on any Internet-connected device.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Dual USB Ports \n									\n								    \n										\n\n										\n												You can share '),
