(33538, 2396, 2, 'Hands-On Review: ASUS Tri-Band Router\n						Read More \n					\n				\n			\n		\n	\n	\n	\n	\n\n		\n		\n		\n		\n		\n			\n				\n\n\n\n\n\n\n	\n		\n	\n	\n\n\n\n				Completely transform your network with the RT-AC3200 Tri-Band Wireless-AC3200 Gigabit Router from ASUS. This router combines 802.11ac Wi-Fi technology with a tri-band configuration to generate maximum data transfer rates of up to 3200 Mbps. This enhanced data transfer rate is perfect for a variety of applications such as streaming 4K/UHD content, online gaming, transferring large files, and more. ASUS has designed this router with simplicity in mind eliminating the hassle of choosing which router band you want to connect to with Tri-Band Smart Connect. \n\n\nThe RT-AC3200 Router from ASUS features 802.11a/b/g/n/ac network standards compatibility, dual band 2.4 GHz and 5 GHz functionality, and comes equipped with four Gigabit Ethernet ports. Accompanying those Gigabit Ethernet ports, you will find one USB 2.0 port and one USB 3.0 port designed to allow you to attach peripherals such as external hard drives and USB printers directly to the router. In addition to the network ports and USB connectivity, you will see six external antennas set up in a 3x3 configuration to support two 802.11ac networks simultaneously. \n\n\nOnce configured, you can secure your wireless network using 64-bit WEP, 128-bit WEP, WPA2-PSK, WPA-PSK, WPA-Enterprise, WPA2-Enterprise, and Radius with 802.1x encryption. You can also connect wireless devices to the network with ease by using the integrated Wi-Fi Protect Setup (WPS) button. With integrated WAN, LAN, WPS, wireless and power LED indicator you can see the status of your network connections and router.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Six External High-Performance Antennas \n									\n								    \n										\n\n										\n												The RT-AC3200 uses two 802.11ac networks, each with a three transmit, three receive (3x3) antenna configuration. This is made possible by it'),
