(33555, 2397, 1, 'ASUS  USB-N10 EZ N Network Adapter USB-N10 B&H Photo Video'),
(33556, 2397, 2, 'The ASUS USB-N10 EZ N Network Adapter is a powerful USB WiFi adapter that offers versatile features in a minuscule design. The small size and strengthened 1-piece design allow you to keep it connected to your laptop at all times, even when placed into a slim carrying case or bag. The USB interface offers compatibility with Windows, Mac, and Linux computers.\n\nThe adapter has an advanced antenna to deliver quality data streaming and a wide wireless operating range. It supports the wireless "N" standard, which is also backwards compatible with "B" and "G" networks. It also supports PSP Xlink connections to you can play system-link games on your PSP over the Internet.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Compact \n									\n								    \n										\n\n										\n												The small size and strengthened 1-piece design allow you to keep the adapter connected to your laptop at all times, even when placed into a slim carrying case or bag\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Wireless N Standard \n									\n								    \n										\n\n										\n												The adapter supports 802.11n WiFi to provide HD quality data streaming and a wide wireless operating range. It is also backwards compatible with "B" and "G" networks\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Advanced Antenna \n									\n								    \n										\n\n										\n												The best-in-class MIFA integrated antenna expands transmission range and reduces size compared to PCB and chip antennas\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										PSP Xlink Kai Support \n									\n								    \n										\n\n										\n												PSP Xlink suppor'),
