(33582, 2402, 1, 'ASUS  RT-N53 Wireless Router RT-N53 B&H Photo Video'),
(33583, 2402, 2, 'The Asus RT-N53 Wireless Router marries striking design and impressive, simultaneous dual-band performance. It offers 300 Mbps speeds for 2 Wireless-N networks at the same time. This router combines the usability of the 2.4 GHz band with the stability of the 5.0 GHz band. Delivering fast connection speeds in both wired and wireless connections, the RT-N53 is great for enabling large home environments to enjoy seamless HD video streaming, online gaming and Internet surfing -- all simultaneously!A straightforward QIS (Quick Internet Setup) web-based wizard ensures that you get to the Internet without a hassle, regardless of your operating system. The unique EZ QoS (Quality of Service) allows you to easily allocate bandwidth according to your individual needs by clicking on the buttons. Multiple SSID connections aid you in creating 3 more separate and limitable access networks for different roles.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Dual-Band For Lag-Free Entertainment \n									\n								    \n										\n\n										\n												Double your wireless performance and bandwidth with simultaneous 2.4 GHz and 5.0 GHz bands, with speeds up to 300 Mbps concurrently. Basic Internet applications like browsing or file downloading can occur in 2.4 GHz while wireless HD content streaming takes place in 5.0 GHz--simultaneously. This way, both achieve optimized speeds and you enjoy smooth, buffer-free HD content streaming!\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Plug-N-Surf and Hassle-Free Management \n									\n								    \n										\n\n										\n												Asus QIS and EZ UI offer you an intuitive router setup that won\'t require reading manuals. Open your browser and let the QIS wizard guide you to quickly connect to the Internet, regardless of your OS. The intuitive user interface gives you a graphical network map, mak'),
