(33605, 2400, 1, 'TP-Link TL-WN725N 150Mbps Wireless N Nano USB Adapter TL-WN725N'),
(33606, 2400, 2, 'With its miniature design the TL-WN725N 150Mbps Wireless N Nano USB Adapter from TP-Link is not only small but extremely light allowing you to plug it in and forget it. This versatile wireless adapter allows you to connect to 802.11b/g/n networks, giving you the ability to get online virtually anywhere there is an available Wi-Fi signal. \n\n\nOnce connected, you can then browse the web, stream video, and download files at ultra fast data speeds of up to 150Mbps. The internal antenna found in the TL-WN725N allows you to connect through frequencies ranging from 2.400-2.4835GHz, giving you even more flexibility with regards to connecting to available wireless networks. With Ad-Hoc and infrastructure modes you can directly connect to an access point through infrastructure mode or create your own temporary network utilizing the Ad-Hoc functionality.\n\n\nSetup and security of your new wireless adapter is a breeze with the bundled CD providing a utility available in 14 languages. This utility helps with everything from installation to wireless network settings and even security configurations. Security configuration also comes in a variety of encryption standards including WPA and WPA2, made accessible from the integrated WPS (Wi-Fi Protected Setup) button located on the adapter.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Miniature Design \n									\n								    \n										\n\n										\n												With its miniature size and sleek design, you can connect the nano adapter to any USB port and leave it there. With the tiny device flush against the USB port, there\'s no need to worry about blocking adjacent USB interfaces, or that the adapter may fall out when moving a connected laptop from A to B.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Stable Wireless Signals \n					