(33629, 2399, 2, 'The Linksys RE2000 N300 Selectable Dual-Band Wireless Range Extender is suitable for extending the range of your current wireless network to enjoy increased in-home mobility. It allows you to connect wired devices such as an Internet-ready TV or Blu-ray player to the wireless network through the built-in Ethernet port.This extender connects to the wall socket directly or can be placed flexibly by connecting the included 4.9\' (1.5m) power extension cable.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Broad Compatibility \n									\n								    \n										\n\n										\n												Wireless-N technology works with all a/g/b/n devices.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Up to N300 + N300 Mbps Speed \n									\n								    \n										\n\n										\n												Boost range of your wireless router on two bands while reducing dead zones.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Simultaneous Dual-Band Operation \n									\n								    \n										\n\n										\n												With support for both the 2.4 GHz and 5 GHz frequencies the RE2000 delivers a stronger connection at a wider range than single band.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Fast Ethernet Ports \n									\n								    \n										\n\n										\n												Two Fast Ethernet ports make it easy to connect two additional wired devices to the network.\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										QoS Traffic Management \n					