(33697, 2405, 1, 'ASUS Dual-Band 300 Mbps Wireless-N USB Adapter - USB-N53 B&H'),
(33698, 2405, 2, 'The ASUS Dual-Band 300 Mbps Wireless-N USB Adapter - Adjustable Cable, WPA2, WPS is a device offering a flexible, dual-band wireless connection for lag-free streaming and high-performance networking. It has a superior antenna design for extensive wireless coverage, and contains a USB cable enabling you to adjust it for enhanced reception. A user-friendly interface utility allows you to install and use the application with ease, making this a great router both at home and on the road.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Flexible Dual-Band Connection \n									\n								    \n										\n\n										\n												Wireless-N dual-band internet application for lag-free, high-definition streaming\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										All Your Internet Needs \n									\n								    \n										\n\n										\n												Great for web-surfing, email receiving, file downloading, movie viewing, music listening and online gaming\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Power Signal Transmission \n									\n								    \n										\n\n										\n												Superior antenna design provides extensive wireless coverage - an increase of more than 150%!\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Enhanced Reception \n									\n								    \n										\n\n										\n												With the USB cable accessory, you can flexibly adjust the antenna to receive the strongest signal'),
