(33721, 2403, 2, 'The ASUS USB-N13 802.11n Network Adapter is a powerful USB WiFi adapter that offers versatile features in a small design. The USB interface offers compatibility with Windows, Mac, and Linux computers. The 2-in-1 design makes it easy to create a small WLAN environment to share a single internet connection with multiple devices.\n\nThe adapter has a specially-designed antenna to deliver consistent transmission and wide coverage. It has WPA/WPA2 encryption for certificate-based authentication to protect your sensitive data. The adapter supports the wireless "N" standard, which is also backwards compatible with "B" and "G" networks. It also supports PSP Xlink connections to you can play system-link games on your PSP over the internet.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Consistent, Wide Coverage \n									\n								    \n										\n\n										\n												The specially-designed internal antenna provides consistent transmission and wide coverage\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										Enterprise Encryption \n									\n								    \n										\n\n										\n												WPA/WPA2 encryption lets you access corporate certificate-based authentication networks to ensure that you\'re working in a protected environment\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										EZ WPS \n									\n								    \n										\n\n										\n												The EZ WPS setup feature takes the hassle of creating a secure wireless connection. Simply press the WPS button on your router and on the adapter and you\'re done!\n										  \n										 \n				                        \n				            		\n				               \n\n				         \n				    \n				               \n									\n										PSP Xlink Kai Support \n									\n								    \n										\n\n										\n					'),
