(33791, 2407, 2, 'Enjoy powerful performance and a vibrant display with the black 10.1" Galaxy Tab A from Samsung. This tablet features a Samsung Exynos 7870 chipset, which utilizes an octa-core processor clocked at speeds up to 1.6 GHz. It comes with 2GB of RAM and 16GB of built-in storage. It\'s also equipped with a microSD slot that supports microSDXC cards up to 2TB. For high-speed Internet connectivity, 802.11a/b/g/n/ac Wi-Fi is built-in. Bluetooth 4.2 connectivity is also integrated for pairing with Bluetooth-enabled devices, such as select headphones and accessories.  This Samsung Galaxy Tab A houses a 10.1" capacitive touchscreen display with a WUXGA 1920 x 1080 screen resolution for viewing detailed high-definition content. The onboard front facing 2-megapixel and rear 8-megapixel cameras allow you take pictures of yourself and the world around you as well as making video calls over your Wi-Fi network.  A micro-USB 2.0 interface is available for mass storage connections and charging the device; a USB cable and charger are included. The internal 7300mAh battery is designed to offer hours of enjoyment before recharging is needed. The Galaxy Tab A comes with the Android 6.0 Marshmallow operating system, which delivers fluid and intuitive multi-touch navigation. The Tab A also supports multitasking tools, such as side-by-side application use.\n			\n		\n		\n\n		\n\n	\n\n	\n		\n\n		\n		      \n				    \n				               \n									\n										Android 6.0 Marshmallow \n									\n								    \n										\n\n										\n												The Android operating system integrates heavily with Google\'s services. Using the card-based Google Now, Android quickly surfaces information for you whenever you need it, powered by the same Knowledge Engine that runs Google\'s web search. It\'s a personalized and customizable OS, allowing you to add your favorite apps or widgets to your homescreen. You can even download new themes using the Google Play Store, which offers access to more than one million apps, games, books, mus'),
